	 ('(a) Except as provided in paragraph (b) of this section, the Secretary may adopt a modification to a standard or implementation specification adopted under this subchapter no more frequently than once every 12 months. (b) The Secretary may adopt a modification at any time during the first year after the standard or implementation specification is initially adopted, if the Secretary determines that the modification is necessary to permit compliance with the standard or implementation specification. (c) The Secretary will establish the compliance date for any standard or implementation specification modified under this section. (1) The compliance date for a modification is no earlier than 180 days after the effective date of the final rule in which the Secretary adopts the modification. (2) The Secretary may consider the extent of the modification and the time needed to comply with the modification in determining the compliance date for the modification. (3) The Secretary may extend the compliance date for small health plans, as the Secretary determines is appropriate. [65 FR 82798, Dec. 28, 2000, as amended at 67 FR 38019, May 31, 2002]',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','A','General Provisions','160.104','Modifications','{}','[0.033203594,0.03618015,0.06733015,0.010579464,-0.013544483,0.07808267,0.013521409,-0.048317116,0.02014367,-0.0023333658,0.02091665,-0.032165263,-0.040379632,0.035187967,0.033203594,-0.04014889,0.016347984,-0.047624893,0.023362502,0.0015589423,0.054500967,0.04919393,-0.021205077,0.055562377,-0.0026059286,-0.047763336,0.00537626,-0.021978058,0.006668408,-0.031265374,0.028681077,-0.012956094,-0.005433945,0.002866954,0.032442153,0.025519928,0.015009686,0.010775594,0.02496615,0.0068991487,-0.01768628,-0.015159668,-0.017697817,0.0046667317,-0.026858225,-0.0034265004,-0.007320251,-0.043402337,-0.018816909,0.018251594,-0.034403447,-0.026881298,0.021355057,0.000833551,-0.0050128433,-0.001000117,0.031219225,0.055793118,0.0151135195,0.0233971