	 ('For purposes of this subpart, the following terms have the following meanings: Contrary, when used to compare a provision of State law to a standard, requirement, or implementation specification adopted under this subchapter, means: (1) A covered entity or business associate would find it impossible to comply with both the State and Federal requirements; or (2) The provision of State law stands as an obstacle to the accomplishment and execution of the full purposes and objectives of part C of title XI of the Act, section 264 of Public Law 104-191, or sections 13400-13424 of Public Law 111-5, as applicable. Mor e stringent means, in the context of a comparison of a provision of State law and a standard, requirement, or implementation specification adopted under subpart E of part 164 of this subchapter, a State law that meets one or more of the following criteria: (1) With respect to a use or disclosure, the law prohibits or restricts a use or disclosure in circumstances under which such use or disclosure otherwise would be permitted under this subchapter, except if the disclosure is: (i) Required by the Secretary in connection with determining whether a covered entity or business associate is in compliance with this subchapter; or (ii) To the individual who is the subject of the individually identifiable health information. (2) With respect to the rights of an individual, who is the subject of the individually identifiable health information, regarding access to or amendment of individually identifiable health information, permits greater rights of access or amendment, as applicable. (3) With respect to information to be provided to an individual who is the subject of the individually identifiable health information about a use, a disclosure, rights, and remedies, provides the greater amount of information. (4) With respect to the form, substance, or the need for express legal permission from an individual, who is the subject of the individually identifiable health information, for use or disclosure of individually identifiable health information, provides requirements that narrow the scope or duration, increase the privacy protections afforded (such as by expanding the criteria for), or reduce the coercive effect of the circumstances surrounding the express legal permission, as applicable. (5) With respect to recordkeeping or requirements relating to accounting of disclosures, provides for the retention or reporting of more detailed information or for a longer duration. (6) With respect to any other matter, provides greater privacy protection for the individual who is the subject of the individually identifiable health information. Relates to the privacy of individually identifiable health information means, with respect to a State law, that the State law has the specific purpose of protecting the privacy of health information or affects the privacy of health information in a direct, clear, and substantial way. State law means a constitution, statute, regulation, rule, common law, or other State action having the force and effect of law. [65 FR 82798, Dec. 28, 2000, as amended at 67 FR 53266, Aug. 14, 2002; 74 FR 42767, Aug. 24, 2009; 78 FR 5689, Jan. 25, 2013]',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','B','Preemption of State Law','160.202','Definitions','{}','[0.0025553883,-0.011623191,0.03731173,0.07800208,0.03148483,0.053519316,-0.0034949142,-0.08696277,0.007669225,0.034251384,0.029599657,-0.02395638,-0.026294485,0.033394486,0.037581038,-0.003785647,0.060668282,-0.014885519,0.017431727,-0.007026552,0.088382766,-0.0052821557,-0.023148451,0.009872673,-0.026808623,-0.062382076,0.0034918538,0.0019203665,0.00975026,0.016158622,0.023393279,-0.0141387945,0.035622418,-0.014053104,0.013355346,0.013857243,-0.010435777,-0.012302588,0.043824144,0.038903106,0.0045017675,-0.05861173,-0.0075162076,0.014126553,-0.032929312,-0.02118983,-0.008562846,-0.06933518,-0.026270002,0.0017948924,-0.030701382,-0.009572759,0.015179312,-0.01437138