	 ('(a) Standard: Authorizations for use and disclosures —(1) A uthorization required: General rule. Except as otherwise permitted or required by this subchapter, a covered entity ma not use or disclose protected health information without an authorization that is valid under this section. When a covered entity obtains or receives a valid authorization for its use or disclosure of protected health information, such use or disclosure must be consistent with such authorization. (2) Authorization required: Psychotherapy notes. Notwithstanding any provision of this subpart, other than the transition provisions in § 164.532, a covered entity must obtain an authorization for any use or disclosure of psychotherapy notes, except: (i) To carry out the following treatment, payment, or health care operations: (A) Use by the originator of the psychotherapy notes for treatment; (B) Use or disclosure by the covered entity for its own training programs in which students, trainees, or practitioners in mental health learn under supervision to practice or improve their skills in group, joint, family, or individual counseling; or (C) Use or disclosure by the covered entity to defend itself in a legal action or other proceeding brought by the individual; and (ii) A use or disclosure that is required by § 164.502(a)(2)(ii) or permitted by § 164.512(a); s y § 164.512(d) with respect to the versight of the originator of the sychotherapy notes; 164.512(g)(1); or 164.512(j)(1)(i). 3) Authorization required: arketing. i) Notwithstanding any provision of his subpart, other than the transition rovisions in § 164.532, a covered ntity must obtain an authorization or any use or disclosure of protected ealth information for marketing, xcept if the communication is in the orm of: A) A face-to-face communication ade by a covered entity to an ndividual; or B) A promotional gift of nominal alue provided by the covered entity. ii) If the marketing involves inancial remuneration, as defined in aragraph (3) of the definition of arketing at § 164.501, to the overed entity from a third party, the uthorization must state that such emuneration is involved. 4) Authorization required: Sale of rotected health information. i) Notwithstanding any provision of his subpart, other than the transition rovisions in § 164.532, a covered ntity must obtain an authorization or any disclosure of protected health nformation which is a sale of rotected health information, as efined in § 164.501 of this subpart. ii) Such authorization must state tha he disclosure will result in emuneration to the covered entity. b) Implementation specifications: eneral requirements 1) Valid authorizations. o p § § ( M ( t p e f h e f ( m i ( v ( f p m c a r ( p ( t p e f i p d ( t t r ( G ( (i) A valid authorization is a document that meets the requirements in paragraphs (a)(3)(ii), (a)(4)(ii), (c)(1), and (c)(2) of this section, as applicable. (ii) A valid authorization may contain elements or information in addition to the elements required by this section, provided that such additional elements or information are not inconsistent with the elements required by this section. (2) Defective authorizations. An authorization is not valid, if the document submitted has any of the following defects: (i) The expiration date has passed or the expiration event is known by the covered entity to have occurred; (ii) The authorization has not been filled out completely, with respect to an element described by paragraph (c) of this section, if applicable; (iii) The authorization is known by the covered entity to have been revoked; (iv) The authorization violates paragraph (b)(3) or (4) of this section, if applicable; (v) Any material information in the authorization is known by the covered entity to be false. (3) Compound authorizations. An authorization for use or disclosure of protected health information may not be combined with any other document to create a compound authorization, except as follows: (i) An authorization for the use or disclosure of protected health information for a research study may be combined with any other type of written permission for the same or another research study. This exception includes combining an author ization for the use or disclosure of protected health information for a research study with another authorization for the same research study, with an authorization for the creation or maintenance of a research database or repository, or with a consent to participate in research. Where a covered health care provider has conditioned the provision of research-related treatment on the provision of one of the authorizations, as permitted under paragraph (b)(4)(i) of this section, any compound authorization created under this paragraph must clearly differentiate between the conditioned and unconditioned components and provide the individual with an opportunity to opt in to the research activities described in the unconditioned authorization. (ii) An authorization for a use or disclosure of psychotherapy notes may only be combined with another authorization for a use or disclosure of psychotherapy notes. (iii) An authorization under this section, other than an authorization for a use or disclosure of psychotherapy notes, may be combined with any other such authorization under this section, except when a covered entity has conditioned the provision of treatment, payment, enrollment in the health plan, or eligibility for benefits under paragraph (b)(4) of this section on the provision of one of the authorizations. The prohibition in this paragraph on combining authorizations where one authorization conditions the provision of treatment, payment, enrollment in a health plan, or eligibility for benefits under paragraph (b)(4) of this section does not apply to a compound authorization created in accordance with paragraph (b)(3)(i) of this section. (4) Prohibition on conditioning of authorizations. A covered entity ma not condition the provision to an individual of treatment, payment, enrollment in the health plan, or eligibility for benefits on the provision of an authorization, excep (i) A covered health care provider may condition the provision of research-related treatment on provision of an authorization for the use or disclosure of protected health information for such research under this section; (ii) A health plan may condition enrollment in the health plan or eligibility for benefits on provision an authorization requested by the health plan prior to an individual''s enrollment in the health plan, if: (A) The authorization sought is for the health plan''s eligibility or enrollment determinations relating t the individual or for its underwritin or risk rating determinations; and (B) The authorization is not for a us or disclosure of psychotherapy note under paragraph (a)(2) of this section; and (iii) A covered entity may condition the provision of health care that is solely for the purpose of creating protected health information for disclosure to a third party on provision of an authorization for the disclosure of the protected health information to such third party. (5) Revocation of authorizations. A individual may revoke an authorization provided under this section at any time, provided that th revocation is in writing, except to th extent that: (i) The covered entity has taken action in reliance thereon; or y t: of o g e s n e e (ii) If the authorization was obtained as a condition of obtaining insurance coverage, other law provides the insurer with the right to contest a claim under the policy or the policy itself. (6) Documentation. A covered entity must document and retain any signed authorization under this section as required by § 164.530(j). (c) Implementation specifications: Core elements and requirements (1) Core elements. A valid authorization under this section must contain at least the following elements: (i) A description of the information to be used or disclosed that identifies the information in a specific and meaningful fashion. (ii) The name or other specific identification of the person(s), or class of persons, authorized to make the requested use or disclosure. (iii) The name or other specific identification of the person(s), or class of persons, to whom the covered entity may make the requested use or disclosure. (iv) A description of each purpose of the requested use or disclosure. The statement “at the request of the individual” is a sufficient description of the purpose when an individual initiates the authorization and does not, or elects not to, provide a statement of the purpose. (v) An expiration date or an expiration event that relates to the individual or the purpose of the use or disclosure. The statement “end of the research study,” “none,” or similar language is sufficient if the authorization is for a use or disclosure of protected health information for research, including for the creation and maintenance of a research database or research repository. (vi) Signature of the individual and date. If the authorization is signed by a personal representative of the individual, a description of such representative''s authority to act for the individual must also be provided. (2) Required statements. In addition to the core elements, the authorization must contain statements adequate to place the individual on notice of all of the following: (i) The individual''s right to revoke the authorization in writing, and either: (A) The exceptions to the right to revoke and a description of how the individual may revoke the authorization; or (B) To the extent that the information in paragraph (c)(2)(i)(A) of this section is included in the notice required by § 164.520, a reference to the covered entity''s notice. (ii) The ability or inability to condition treatment, payment, enrollment or eligibility for benefits on the authorization, by stating either: (A) The covered entity may not condition treatment, payment, enrollment or eligibility for benefits on whether the individual signs the authorization when the prohibition on conditioning of authorizations in paragraph (b)(4) of this section applies; or (B) The consequences to the individual of a refusal to sign the authorization when, in accordance with paragraph (b)(4) of this section, the covered entity can condition treatment, enrollment in the health plan, or eligibility for benefits on failure to obtain such authorization. (iii) The potential for information disclosed pursuant to the authorization to be subject to redisclosure by the recipient and no longer be protected by this subpart. (3) Plain language requirement. The authorization must be written in plain language. (4) Copy to the individual. If a covered entity seeks an authorization from an individual for a use or disclosure of protected health information, the covered entity must provide the individual with a copy of the signed authorization. [67 FR 53268, Aug. 14, 2002, as amended at 78 FR 5699, Jan. 25, 2013]',164,'SECURITY AND PRIVACY','E','Privacy of Individually Identifiable Health Information','164.508','Uses and disclosures for which an authorization is required','{164.501,164.502,164.512,164.520,164.530,164.532}','[0.017928747,0.055783875,0.03361016,0.023422236,0.010531267,0.029440103,-0.0043947906,-0.017454311,0.0069729844,0.025344957,0.055534173,-0.055184588,-0.009563664,0.028690992,0.007703369,0.0059835324,0.074411795,0.003701862,-0.005187601,-0.009919492,0.04664471,0.005493488,-0.025332471,0.026518567,-0.01990141,-0.020375848,0.019426972,0.009207835,0.017928747,-0.018340759,0.022635669,-0.011892154,-0.021124959,0.021512,-0.018727802,0.0074723926,-0.009588634,-0.009863309,0.030788505,-0.005687009,0.004928533,-0.06412399,0.022960285,0.061926596,-0.013096975,-0.0032211817,-0.022623183,-0.049291573,-0.017254548,-0.022410935,-0.023110107,0.032736197,-0.011898397,0.024932945,-0.028790873,0.042025186,-0.019938866,0.0153443115,0.025919277,0.029415132,0.028291464,-0.005181358,-0.024720697,