	 ('(a) Provide records and compliance reports. A covered entity or business associate must keep such records and submit such compliance reports, in such time and manner and containing such information, as the Secretary may determine to be necessary to enable the Secretary to ascertain whether the covered entity or business associate has complied or is complying with the applicable administrative simplification provisions. (b) Cooperate with complaint investigations and compliance reviews. A covered entity or business associate must cooperate with the Secretary, if the Secretary undertakes an investigation or compliance review of the policies, procedures, or practices of the covered entity or business associate to determine whether it is complying with the applicable administrative simplification provisions. (c) Permit a ccess to information. (1) A covered entity or business associate must permit access by the Secretary during normal business hours to its facilities, books, records, accounts, and other sources of information, including protected health information, that are pertinent to ascertaining compliance with the applicable administrative simplification provisions. If the Secretary determines that exigent circumstances exist, such as when documents may be hidden or destroyed, a covered entity or business associate must permit access by the Secretary at any time and without notice. (2) If any information required of a covered entity or business associate under this section is in the exclusive possession of any other agency, institution, or person and the other agency, institution, or person fails or refuses to furnish the information, the covered entity or business associate must so certify and set forth what efforts it has made to obtain the information. (3) Protected health information obtained by the Secretary in connection with an investigation or compliance review under this subpart will not be disclosed by the Secretary, except if necessary for ascertaining or enforcing compliance with the applicable administrative simplification provisions, if otherwise required by law, or if permitted under 5 U.S.C. 552a(b)(7). [78 FR 5690, Jan. 25, 2013]',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','C','Compliance and Investigations','160.310','Responsibilities of covered entities and business associates','{}','[0.017776346,0.011266525,0.045017064,0.05462855,0.03668057,0.027829176,0.01058612,-0.008912692,0.036067594,0.014368191,0.016476834,-0.06134678,0.024494579,0.0010589185,-0.023881601,0.031629637,0.059924673,-0.015679963,0.037391625,0.008679761,0.031335406,0.029275803,0.0019216842,0.03143348,-0.037587777,-0.05654104,-0.0055014724,-0.0019002301,0.03403251,-0.012762191,0.05026415,0.0001694308,-0.023550592,0.03810268,0.032389726,0.04560552,-0.034596447,-0.043545917,0.026014762,0.030845026,0.00020956167,-0.010984556,0.0015768844,-0.029570032,0.0041743764,0.011168449,-0.024972701,-0.057668917,-0.021858776,0.017420819,-0.010555471,0.042197365,0.028662825,-0.041952178,0.0018603866,0.0413392,0.007944188,0.00026415498,-0.019517202,0.019725613,0.018082835,0.016722025,-0.04746897,-0.0036472157,-0.029766185,0.00203815,0.027976291,0.062376585,-0.004054846,-0.012032747,0.016623948,0.05134299,0.0039261207,-0.017874422,0.017163368,0.02146647,0.023759006,0.016219383,-0.008054524,0.004946728,-0.048474256,-0.021674883,-0.031776752,0.0020856557,-0.020142438,0.040995933,-0.06610349,0.05953237,-0.03121281,0.0067243627,0.028932536,0.032144535,-0.06605445,0.03236521,0.060660247,0.013129977,-0.010843571,-0.007190225,-0.020534744,0.041437276,0.013963626,-0.045213215,-0.02204267,-0.021785218,0.07203711,0.058306415,-0.044183414,-0.056197774,-0.006552729,-0.032732997,0.0277311,-0.0048547816,0.047616087,0.00074668316,-0.0025331292,-0.012946083,-0.057816032,0.0019247491,-0.007889019,-0.016231643,0.012725412,-0.010340929,-0.022361416,-0.039598342,0.015937414,0.039524786,0.03317434,-0.016709765,-0.017494377,-0.01870807,0.045752637,-0.02856475,0.06404388,-0.055