	 ('A covered entity may use or disclose protected health information, provided that the individual is informed in advance of the use or disclosure and has the opportunity to agree to or prohibit or restrict the use or disclosure, in accordance with the applicable requirements of this section. The covered entity may orally inform the individual of and obtain the individual''s oral agreement or objection to a use or disclosure permitted by this section. (a) Standard: Use and disclosure for facility directories (1) Permitted uses and disclosure. Except when an objection is expressed in accordance with paragraphs (a)(2) or (3) of this section, a covered health care provider may: (i) Use the following protected health information to maintain a directory of individuals in its facility: (A) The individual''s name; (B) The individual''s location in the covered health care provider''s facility; (C) The individual''s condition described in general terms that does not communicate specific medical information about the individual; and (D) The individual''s religious affiliation; and (ii) Use or disclose for directory purposes such information: (A) To members of the clergy; or (B) Except for religious affiliation, to other persons who ask for the individual by name. (2) Opportunity to object. A covered health care provider must inform an individual of the protected health information that it may include in a directory and the persons to whom it may disclose such information (including disclosures to clergy of information regarding religious affiliation) and provide the individual with the opportunity to restrict or prohibit some or all of the uses or disclosures permitted by paragraph (a)(1) of this section. (3) Emergency circumstances. (i) If the opportunity to object to uses or disclosures required by paragraph (a)(2) of this section cannot practicably be provided because of the individual''s incapacity or an emergency treatment circumstance, a covered health care provider may use or disclose some or all of the protected health information permitted by paragraph (a)(1) of this section for the facility''s directory, if such disclosure is: (A) Consistent with a prior expressed preference of the individual, if any, that is known to the covered health care provider; and (B) In the individual''s best interest as determined by the covered health care provider, in the exercise of professional judgment. (ii) The covered health care provider must inform the individual and provide an opportunity to object to uses or disclosures for directory purposes as required by paragraph (a)(2) of this section when it become practicable to do so. (b) Standard: Uses and disclosures for involvement in the individual''s care and notification purposes (1) Permitted uses and disclosures. (i) A covered entity may, in accordance with paragraphs (b)(2), (b)(3), or (b)(5) of this section, disclose to a family member, other relative, or a close personal friend of the individual, or any other person identified by the individual, the protected health information directly relevant to such person''s involvement with the individual''s health care or payment related to the individual''s health care. (ii) A covered entity may use or disclose protected health information to notify, or assist in the notification of (including identifying or locating), a family member, a personal representative of the individual, or another person responsible for the care of the individual of the individual''s location, general condition, or death. Any such use or disclosure of protected health information for such notification purposes must be in accordance with paragraphs (b)(2), (b)(3), (b)(4), or (b)(5) of this section, as applicable. s ( 2) Uses and disclosures with the individual present. If the individual is present for, or otherwise available prior to, a use or disclosure permitted by paragraph (b)(1) of this section and has the capacity to make health care decisions, the covered entity may use or disclose the protected health information if it: (i) Obtains the individual''s agreement; (ii) Provides the individual with the opportunity to object to the disclosure, and the individual does not express an objection; or (iii) Reasonably infers from the circumstances, based on the exercise of professional judgment, that the individual does not object to the disclosure. (3) Limited uses and disclosures when the individual is not present. If the individual is not present, or the opportunity to agree or object to the use or disclosure cannot practicably be provided because of the individual''s incapacity or an emergency circumstance, the covered entity may, in the exercise of professional judgment, determine whether the disclosure is in the best interests of the individual and, if so, disclose only the protected health information that is directly relevant to the person''s involvement with the individual''s care or payment related to the individual''s health care or needed for notification purposes. A covered entity may use professional judgment and its experience with common practice to make reasonable inferences of the individual''s best interest in allowing a person to act on behalf of the individual to pick up filled prescriptions, medical supplies, X-rays, or other similar forms of protected health information. (4) Uses and disclosures for disaster relief purposes. A covered entity may use or disclose protected health information to a public or private entity authorized by law or by its charter to assist in disaster relief efforts, for the purpose of coordinating with such entities the uses or disclosures permitted by paragraph (b)(1)(ii) of this section. The requirements in paragraphs (b)(2), (b)(3), or (b)(5) of this section apply to such uses and disclosures to the extent that the covered entity, in the exercise of professional judgment, determines that the requirements do not interfere with the ability to respond to the emergency circumstances. (5) Uses and disclosures when the individual is deceased. If the individual is deceased, a covered entity may disclose to a family member, or other persons identified in paragraph (b)(1) of this section who were involved in the individual''s care or payment for health care prior to the individual''s death, protected health information of the individual that is relevant to such person''s involvement, unless doing so is inconsistent with any prior expressed preference of the individual that is known to the covered entity. [65 FR 82802, Dec. 28, 2000, as amended at 67 FR 53270, Aug. 14, 2002; 78 FR 5699, Jan. 25, 2013]',164,'SECURITY AND PRIVACY','E','Privacy of Individually Identifiable Health Information','164.510','Uses and disclosures requiring an opportunity for the individual to agree or to object','{}','[0.011740962,0.0014104402,0.006114449,0.05157484,0.013247464,0.017529104,-0.044816926,-0.015260201,-0.018992912,0.041572154,0.048427656,-0.056990933,0.027056055,0.030886354,0.038498156,0.00869746,0.08504726,0.021761948,-0.00053901685,0.011332315,0.0328137,0.043865453,0.010850478,0.011515291,-0.031276703,-0.031081527,0.020176155,-0.0044676648,0.032008607,0.022249885,0.001381469,-0.021152029,0.0057210503,0.017760873,0.00335761,0.013576821,0.008441294,-0.015260201,0.03869333,0.037741855,-0.0024778002,-0.06318772,-0.0313011,0.007678894,-0.046817467,-0.0069713867,-0.039108075,-0.0450121,0.018895324,0.0015446226,0.0077337865,0.038742125,-0.010582114,0.027665975,-0.0167972,0.02153018,-0.00938667,0.012387477,0.013564623,0.0040712166,-0.0033942054,-0.022030313,-0.013442638,-0.025543453,-0.002008162,0.0058887783,0.011423803,0.05830836,0.0071238666,0.007904564,0.004641492,0.052843478,-0.03235016,0.008252218,-0.010661403,0.036278047,0.0071177674,0.015211407,-0.041572154,0.008355905,0.032545336,0.01595551,-0.06143115,0.05328262,-0.03378957,0.043548293,-0.050794143,0.013784193,-0.020578703,-0.006074804,-0.00056227006,0.017614491,-0.030861957,0.006654228,0.01579693,-0.027690371,-0