	 ('A covered entity or business associate may not threaten, intimidate, coerce, harass, discriminate against, or take any other retaliatory action against any individual or other person for— (a) Filing of a complaint under § 160.306; (b) Testifying, assisting, or participating in an investigation, compliance review, proceeding, or hearing under this part; or (c) Opposing any act or practice made unlawful by this subchapter, provided the individual or person has a good faith belief that the practice opposed is unlawful, and the manner of opposition is reasonable and does not involve a disclosure of protected health information in violation of subpart E of part 164 of this subchapter. [71 FR 8426, Feb. 16, 2006, as amended at 78 FR 5691, Jan. 25, 2013]',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','C','Compliance and Investigations','160.316','Refraining from intimidation or retaliation','{160.306}','[0.0173686,-0.018466067,0.0652754,0.07090588,-0.018549569,0.040630117,0.00019794657,-0.025575742,-0.00015097621,-0.00012422918,0.047477357,-0.025647314,0.032947853,0.048360102,0.014064272,0.04105956,0.06093325,-0.032566126,0.023989186,0.012787871,0.06517997,0.0640825,-0.0005886208,0.034570195,-0.028748851,-0.028748851,-0.0041393572,-0.0046224813,-0.0016745311,-0.016724436,0.056066222,-0.0084934365,-0.023022939,0.023142228,0.032494552,0.029965607,-0.020804148,-0.058356587,0.029488448,0.015650827,-0.0077657686,-0.050531175,0.016139915,0.011451825,-0.0434215,0.014708437,0.0060599237,-0.05530277,-0.0052189305,0.00016803092,0.0010132181,0.022140194,0.015042448,0.00681145,-0.018275203,0.014780011,0.0086365845,0.020828005,-0.014314781,0.029512307,-0.031969678,-0.012644723,-0.050626606,-0.02722194,-0.036836702,-0.03511893,0.03342501,0.032589983,0.011869339,-0.0057885395,0.022164052,0.028319407,0.0022277378,0.03616868,0.01026489,0.012453859,0.05515962,-0.03874534,0.017523678,-0.027555952,-0.07410285,0.012465788,-0.0092747845,0.033830598,-0.023416596,0.038697623,-0.080926225,0.012561