	 ('As used in this subpart, the following terms have the following meanings: Reasonable cause means an act or omission in which a covered entity or business associate knew, or by exercising reasonable diligence would have known, that the act or omission violated an administrative simplification provision, but in which the covered entity or business associate did not act with willful neglect. Reasonable diligence means the business care and prudence expected from a person seeking to satisfy a legal requirement under similar circumstances. Willful neglect means conscious, intentional failure or reckless indifference to the obligation to comply with the administrative simplification provision violated. [74 FR 56130, Oct. 30, 2009, as amended at 78 FR 5691, Jan. 25, 2013]',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','D','Imposition of Civil Money Penalties','160.401','Definitions','{}','[0.017905291,0.013578689,-0.032412853,0.07181672,0.04901039,0.013383135,0.00188525,-0.008097103,0.030188443,0.028452912,0.0355417,-0.01825973,0.013872017,0.0045252107,0.018186398,0.027377373,0.035981692,-0.06585236,-0.00027060363,-0.0059521343,0.084674306,0.047910403,-0.014507564,0.053141437,-0.011207612,-0.041946046,0.0034435603,-0.026497386,0.021266352,-0.0016377536,0.0710834,-0.011390943,0.0013161611,0.005747415,0.021046355,0.011641495,-0.014935335,-0.033928387,0.038768318,-0.022085229,0.018027512,-0.069127865,0.024492972,-0.03796166,0.015020889,-0.0016438646,-0.0009624858,-0.04473267,-0.011128169,-0.0110426145,-0.028526245,0.013798685,0.03537059,-0.023784094,0.00916042,0.018821944,0.009600414,0.00017760154,-0.005004926,0.019347493,0.017343078,-0.04901039,-0.02652183,-0.01861417,-0.02681516,-0.043803796,0.025812952,0.0023328823,-0.014507564,0.0008608901,0.013859795,0.049645934,0.033488393,-0.025128517,0.02280633,0.012820922,0.04903483,0.05231034,-0.022085229,0.009783744,-0.042117156,-0.016023096,-0.019261938,0.017013082,-0.03309729,0.008317099,-0.08032326,0.023099659,-0.0056007504,-0.0