	 ('(a) The amount of a civil money penalty will be determined in accordance with paragraph (b) of this section and §§ 160.406, 160.408, and 160.412. (b) The amount of a civil money penalty that may be imposed is subject to the following limitations: (1) For violations occurring prior to February 18, 2009, the Secretary may not impose a civil money penalty— (i) In the amount of more than $100 for each violation; or (ii) In excess of $25,000 for identical violations during a calendar year (January 1 through the following December 31); (2) For violations occurring on or after February 18, 2009, the Secretary may not impose a civil money penalty— (i) For a violation in which it is established that the covered entity or business associate did not know and, by exercising reasonable diligence, would not have known that the covered entity or business associate violated such provision, (A) In the amount of less than $100 or more than $50,000 for each violation; or (B) In excess of $1,500,000 for identical violations during a calendar year (January 1 through the following December 31); (ii) For a violation in which it is established that the violation was due to reasonable cause and not to willful neglect, (A) In the amount of less than $1,000 or more than $50,000 for each violation; or (B) In excess of $1,500,000 for identical violations during a calendar year (January 1 through the following December 31); (iii) For a violation in which it is established that the violation was due to willful neglect and was corrected during the 30-day period beginning on the first date the covered entity or business associate liable for the penalty knew, or, by exercising reasonable diligence, would have known that the violation occurred, (A) In the amount of less than $10,000 or more than $50,000 for each violation; or (B) In excess of $1,500,000 for identical violations during a calendar year (January 1 through the following December 31); (iv) For a violation in which it is established that the violation was due to willful neglect and was not corrected during the 30- day period beginning on the first date the covered entity or business associate liable for the penalty knew, or, by exercising reasonable diligence, would have known that the violation occurred, (A) In the amount of less than $50,000 for each violation; or (B) In excess of $1,500,000 for identical violations during a calendar year (January 1 through the following December 31). (3) If a requirement or prohibition in one administrative simplification provision is repeated in a more general form in another administrative simplification provision in the same subpart, a civil money penalty may be imposed for a violation of only one of these administrative simplification provisions. [71 FR 8426, Feb. 16, 2006, as amended at 74 FR 56130, Oct. 30, 2009; 78 FR 5691, Jan. 25, 2013]',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','D','Imposition of Civil Money Penalties','160.404','Amount of a civil money penalty','{160.406}','[0.010669824,-0.0085783135,0.064381056,0.053093143,-0.006006068,0.05329293,0.015008927,-0.021264728,-0.01592045,0.015321093,0.010719771,-0.026196945,0.017119167,0.032665018,0.019416707,0.0024083585,0.018467722,-0.031341437,-0.0030295681,-0.015083847,0.049197316,0.018130584,-0.024561197,0.04350341,-0.0015475615,-0.018492697,-0.0033651462,-0.040706407,0.04884769,0.032340366,0.05843742,-0.015296119,-0.014222269,-0.0081974715,-0.0030841972,0.02914379,0.0096896235,0.015158767,0.038059242,-0.009477351,-0.0124991145,-0.024748497,0.014334649,-0.03963256,-0.0493971,0.015208713,0.0042485753,-0.032315392,-0.054391753,-0.001160476,-0.016869435,0.012986093,0.008859263,-0.013523018,0.028944004,0.008434718,-0.017681066,0.011100613,0.027170902,0.015408499,0.030167693,-0.0138476705,-0.01910454,-0.026871223,-0.028494485,0.017219061,0.0072672176,0.02443633,0.0007012022,0.043453466,0.025947213,0.057188757,0.09145206,-0.0351124,0.009639677,0.040156998,0.03426331,0.01499644,0.033389244,0.0066303997,-0