	 ('In determining the amount of any civil money penalty, the Secretary will consider the following factors, which may be mitigating or aggravating as appropriate: (a) The nature and extent of the violation, consideration of which may include but is not limited to: (1) The number of individuals affected; and (2) The time period during which the violation occurred; (b) The nature and extent of the harm resulting from the violation, consideration of which may include but is not limited to: (1) Whether the violation caused physical harm; (2) Whether the violation resulted in financial harm; (3) Whether the violation resulted in harm to an individual''s reputation; and (4) Whether the violation hindered an individual''s ability to obtain health care; (c) The history of prior compliance with the administrative simplification provisions, including violations, by the covered entity or business associate, consideration of which may include but is not limited to: (1) Whether the current violation is the same or similar to previous indications of noncompliance; (2) Whether and to what extent the covered entity or business associate has attempted to correct previous indications of noncompliance; (3) How the covered entity or business associate has responded to technical assistance from the Secretary provided in the context of a compliance effort; and (4) How the covered entity or business associate has responded to prior complaints; (d) The financial condition of the covered entity or business associate, consideration of which may include but is not limited to: (1) Whether the covered entity or business associate had financial difficulties that affected its ability to comply; (2) Whether the imposition of a civil money penalty would jeopardize the ability of the covered entity or business associate to continue to provide, or to pay for, health care; and (3) The size of the covered entity or business associate; and (e) Such other matters as justice may require. [78 FR 5691, Jan. 25, 2013]',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','D','Imposition of Civil Money Penalties','160.408','Factors considered in determining the amount of a civil money penalty','{}','[-0.0025880195,-0.0055043353,0.07393114,0.0719675,0.007676615,0.04246377,0.0056209266,-0.03203192,-0.010002304,0.046931054,0.024570078,-0.028939182,-0.02285189,0.01570914,0.022324162,0.0023149503,0.04354377,-0.04317559,-0.0025726785,0.0034026243,0.0321301,0.057829272,-0.017108236,0.016789144,-0.0140645895,-0.039935578,-0.016715506,-0.02161234,0.054098353,0.02303598,0.07064204,-0.009069574,-0.030878277,0.018225057,-0.019685516,0.040500127,-0.018666876,0.0023471664,0.034020107,0.0043660365,-0.012751403,-0.016445506,0.0038229665,-0.011708219,-0.034756474,-0.0074925236,0.005369335,-0.040303763,-0.053656533,0.0048446744,-0.009382529,0.051545616,0.0068052486,-0.0029469978,0.027196448,0.026582811,-0.015218229,0.0017749488,0.031221915,0.0059891096,0.03235101,-0.012775949,-0.032547373,-0.015770504,-0.029135546,0.005611722,0.019133242,0.021084612,-0.006615021,0.00641252,0.05974382,0.047642875,0.088069364,-0.0077625243,0.015549595,0.020225517,0.026680993,-0.014997319,0.043347407,0.029945549,-0.011929128,-0.04126104,0.017611418,0.019194605,-0.014322317,-0.00054000167,-0.091309376,0.028276453,-0.041457403,-5.2614687e-06,-0.025048714,0.055571083,-0.04796197,0.047421966,0.008192071,0.0034333062,0.0056178584,-0.035861023,-0.005482858,0.00010211325,-0.001794892,-0.03026464,0.015316412,-0.0056608133,0.046219237,0.029577365,-0.019501425,-0.041653767,-0.006522975,-0.005353994,0.061167464,0.004280127,-0.04015649,0.05503108,-0.023895076,-0.0017749488,-0.075992964,0.03856103,-0.009180029,-0.0106343515,0.0007079852,-0.011493445,-0.012702312,-0.029896457,0.024385985,0.04607196,0.0035314884,0.018200511,-0.025748262,-0.040082853,0.071280226,-0.003721716,0.029184638,-0.04548287,0.0037063751,0.039861944,0.030731006,0.037530117,-0.0007704996,-0.09553121,0.020434154,0.028104633,0.021538705,0.04548287,-0.028325543,-