	 ('(a) The Secretary may not: (1) Prior to February 18, 2011, impose a civil money penalty on a covered entity or business associate for an act that violates an administrative simplification provision if the covered entity or business associate establishes that the violation is punishable under 42 U.S.C. 1320d-6. (2) On or after February 18, 2011, impose a civil money penalty on a covered entity or business associate for an act that violates an administrative simplification provision if the covered entity or business associate establishes that a penalty has been imposed under 42 U.S.C. 1320d-6 with respect to such act. (b) For violations occurring prior to February 18, 2009, the Secretary may not impose a civil money penalty on a covered entity for a violation if the covered entity establishes that an affirmative defense exists with respect to the violation, including the following: (1) The covered entity establishes, to the satisfaction of the Secretary, that it did not have knowledge of the violation, determined in accordance with the Federal common law of agency, and by exercising reasonable diligence, would not have known that the violation occurred; or (2) The violation is— (i) Due to circumstances that would make it unreasonable for the covered entity, despite the exercise of ordinary business care and prudence, to comply with the administrative simplification provision violated and is not due to willful neglect; and (ii) Corrected during either: (A ) The 30-day period beginning on the first date the covered entity liable for the penalty knew, or by exercising reasonable diligence would have known, that the violation occurred; or (B) Such additional period as the Secretary determines to be appropriate based on the nature and extent of the failure to comply. (c) For violations occurring on or after February 18, 2009, the Secretary may not impose a civil money penalty on a covered entity or business associate for a violation if the covered entity or business associate establishes to the satisfaction of the Secretary that the violation is— (1) Not due to willful neglect; and (2) Corrected during either: (i) The 30-day period beginning on the first date the covered entity or business associate liable for the penalty knew, or, by exercising reasonable diligence, would have known that the violation occurred; or (ii) Such additional period as the Secretary determines to be appropriate based on the nature and extent of the failure to comply. [78 FR 5692, Jan. 25, 2013]',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','D','Imposition of Civil Money Penalties','160.410','Affirmative defenses','{}','[0.011003213,0.010174248,0.055022545,0.044012852,0.020788886,0.05445263,0.0038598678,-0.00849689,0.008639368,0.02519276,0.040981952,-0.039608978,0.012680572,0.024804184,0.019118002,0.0026730879,0.030153597,-0.02896196,-0.0003163262,0.011171597,0.05263927,0.02444151,-0.014545743,0.04398695,-0.02091841,-0.03227782,0.0055663697,-0.022718819,0.045126777,0.018353801,0.060514435,-0.008885467,-0.027226316,0.0093258545,0.012479807,0.04279531,0.0023120348,0.005660276,0.02242091,0.0056991335,-0.009105661,-0.026164204,0.0061459974,-0.042173587,-0.022990823,0.025309334,-0.003213858,-0.03675941,-0.040748805,0.0014806413,-0.0069166757,0.01362611,0.01488251,-0.016320245,0.009824529,0.030127693,0.0060326625,-0.0065572415,-0.0043261605,0.008529271,0.011683224,0.018211322,-0.029402347,-0.015478329,-0.023716167,0.010893117,0.011683224,0.043831516,0.0017939318,0.021721471,0.0096302405,0.054659873,0.07647201,-0.02282244,0.031189803,0.028443858,0.04162958,0.04077471,0.0296614,0.018029986,-0.019843347,-0.04082652,-0.030334933,0.01795227,-0.049090263,0.041940443,-0.058286592,0.05787211,-0.005190745,0.018224275,0.024027029,0.046214793,-0.05486711,0.0082637435,0.03549006,-0.0017809792,0.002383274,0.005119506,0.028236616,0.008134218,-0.0056958953,-0.053157374,0.003778914,0.017732076,0.027666703,0.00030640938,-0.03442795,-0.027899848,-0.0072728717,-0.0206205,0.04147415