	 ('If the respondent does not request a hearing within the time prescribed by § 160.504 of this part a nd the matter is not settled pursuant to § 160.416, the Secretary will impose the proposed penalty or any lesser penalty permitted by 42 U.S.C. 1320d-5. The Secretary will notify the respondent by certified mail, return receipt requested, of any penalty that has been imposed and of the means by which the respondent may satisfy the penalty, and the penalty is final on receipt of the notice. The respondent has no right to appeal a penalty under § 160.548 of this part with respect to which the respondent has not timely requested a hearing.',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','D','Imposition of Civil Money Penalties','160.422','Failure to request a hearing','{160.416,160.504,160.548}','[0.0033349681,0.025463646,0.064775944,0.032710608,-0.03285952,0.075100385,-0.021492707,-0.011875589,0.005838521,0.0038003125,0.032040514,-0.009021477,-0.010194144,0.03330625,0.009691573,-0.023974543,0.017571405,-0.007855013,0.0039678365,0.021207295,0.01490343,0.0267542,-0.0046255235,0.017248766,0.012148591,0.0010439226,0.00926966,-0.012967597,0.0114474725,0.01914737,0.008835339,-0.014332607,-0.026233016,-0.019432781,0.04090067,0.052217845,0.01475452,0.016045075,-0.019345917,-0.016107121,-0.038145833,-0.030973323,-0.022075938,-0.0072159404,-0.044300787,0.0031224608,0.021083204,-0.029087126,-0.0182415,-0.025960013,-0.003155035,0.07802895,0.0094061615,0.015176432,0.011503314,0.010504374,-0.006384525,0.014134061,0.0019823671,0.009821869,0.008860157,0.016156757,-0.044077422,0.02586074,-0.022175211,-0.007786763,-0.008369994,0.066513225,0.013799013,0.03300843,0.0044548973,0.009282069,0.05762825,-0.042613138,0.008090788,0.012576708,0.023019036,-0.012992416,0.033256613,0.009362729,-0.035266902,-0.029980589,-0.022435805,0.0049729804,-0.034596805,0.0068312557,-0.047080442,0.061202094,0.011726678,-0.02814403,-0.030154318,0.048470274,-0.02814403,0.007855013,0.014506336,0.0004595276,-0.0228204