	 ('(a) Once a determination of the Secretary to impose a penalty has become final, the penalty will be collected by the Secretary, subject to the first sentence of 42 U.S.C. 1320a- 7a(f). (b) The penalty may be recovered in a civil action brought in the United States district court for the district where the respondent resides, is found, or is located. (c) The amount of a penalty, when finally determined, or the amount agreed upon in compromise, may be deducted from any sum then or later owing by the United States, or by a State agency, to the respondent. (d) Matters that were raised or that could have been raised in a hearing before an ALJ, or in an appeal under 42 U.S.C. 1320a- 7a(e), may not be raised as a defense in a civil action by the United States to collect a penalty under this part.',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','D','Imposition of Civil Money Penalties','160.424','Collection of penalty','{}','[0.026209006,-0.0056286133,0.078056715,0.05122782,-0.0029940752,0.03508585,-0.021063907,-0.025266772,-0.003998299,0.016005594,0.04500411,0.0077052494,-0.029407645,0.023630258,0.0141211245,-0.013687201,0.02298557,-0.021584617,-0.0027430193,-0.008752866,0.027944703,0.023803828,0.012831751,0.009223984,-0.008356135,-0.015931208,-0.0074200993,-0.019092653,0.011381205,0.033920456,0.020679574,-0.0132904705,-0.056633275,0.0106373355,0.017047012,0.06367524,-0.0025028114,0.006806407,-0.0032823246,-0.0054984363,-0.01666268,-0.025837071,-0.016501507,0.025056008,-0.029655602,-0.015509682,0.031862415,-0.02082835,-0.02960601,-0.029680397,-0.01888189,0.043119643,0.012168467,0.036647975,0.012193263,0.01568325,-0.015013768,0.024808051,0.007066761,0.007860222,-0.0025183086,0.03565615,-0.02635778,-0.010649733,-0.02801909,0.00803999,-0.015112951,0.06818805,-0.015112951,0.008374732,-0.0058672717,0.020059684,0.081676885,-0.021708595,-0.022861592,0.023952601,0.04123517,-0.0046367873,0.020580392,0.019117448,-0.037788577,-0.04175588,-0.0013823577,0.005138899,-0.02258884,0.0043516