	 ('(a) Except as otherwise limited by this subpart, each party may— (1) Be accompanied, represented, and advised by an attorney; (2) Participate in any conference held by the ALJ; (3) Conduct discovery of documents as permitted by this subpart; (4) Agree to stipulations of fact or law that will be made part of the record; (5) Present evidence relevant to the issues at the hearing; (6) Present and cross-examine witnesses; (7) Present oral arguments at the hearing as permitted by the ALJ; and (8) Submit written briefs and proposed findings of fact and conclusions of law after the hearing. (b) A party may appear in person or by a representative. Natural persons who appear as an attorney or other representative must conform to the standards of conduct and ethics required of practitioners before the courts of the United States. (c) Fees for any services performed on behalf of a party by an attorney are not subject to the provisions of 42 U.S.C. 406, which authorizes the Secretary to specify or limit their fees.',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','E','Procedures for Hearings','160.506','Rights of the parties','{}','[0.016374538,0.02880547,0.02461692,0.043747082,0.0030572133,0.030569071,-0.049919683,-0.025841642,0.0062399604,0.04036685,0.02758075,-0.013202507,0.042326406,0.03162233,-0.028976932,0.042375393,0.026698949,0.0066992315,0.006907434,-0.0026147824,0.026772432,0.019595558,0.0007045981,0.009405868,0.0020146684,-0.017966678,-0.0052785533,-0.009160924,0.038309317,0.032038737,0.031965256,-0.016019369,-0.027654232,-0.0060838084,-0.0026775494,0.08239932,-0.02995671,-0.047298778,-0.017329821,-0.042987756,0.013386216,-0.024433212,-0.008824125,-0.0015439157,-0.0064604105,0.020085447,0.012381944,0.009277272,-0.0049325693,0.0029622973,0.0066992315,0.022828825,0.037182573,0.05545543,0.021824554,0.06770265,0.011836942,0.0053826547,0.033998296,-0.0043048994,-0.03453717,0.03078952,-0.015455997,0.013178013,-0.062411852,-0.02571917,-0.020955,0.046441473,0.008560809,0.04734