	 ('(a) The ALJ must conduct a fair and impartial hearing, avoid delay, maintain order, and ensure that a record of the proceeding is made. (b) The ALJ may— (1) Set and change the date, time and place of the hearing upon reasonable notice to the parties; (2) Continue or recess the hearing in whole or in part for a reasonable period of time; (3) Hold conferences to identify or simplify the issues, or to consider other matters that may aid in the expeditious disposition of the proceeding; (4) Administer oaths and affirmations; (5) Issue subpoenas requiring the attendance of witnesses at hearings and the production of documents at or in relation to hearings; (6) Rule on motions and other procedural matters; (7) Regulate the scope and timing of documentary discovery as permitted by this subpart; (8) Regulate the course of the hearing and the conduct of representatives, parties, and witnesses; (9) Examine witnesses; (10) Receive, rule on, exclude, or limit evidence; (11) Upon motion of a party, take official notice of facts; (12) Conduct any conference, argument or hearing in person or, upon agreement of the parties, by telephone; and (13) Upon motion of a party, decide cases, in whole or in part, by summary judgment where there is no disputed issue of material fact. A summary judgment decision constitutes a hearing on the record for the purposes of this subpart. (c) The ALJ— (1) May not find invalid or refuse to follow Federal statutes, regulations, or Secretarial delegations of authority and must give deference to published guidance to the extent not inconsistent with statute or regulation; (2) May not enter an order in the nature of a directed verdict; (3) May not compel settlement negotiations; (4) May not enjoin any act of the Secretary; or (5) May not review the exercise of discretion by the Secretary with respect to whether to grant an extension under § 160.410(b)(2)(ii)(B) or (c)(2)(ii) of this part or to provide technical assistance under 42 U.S.C. 1320d- 5(b)(2)(B).',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','E','Procedures for Hearings','160.508','Authority of the ALJ','{160.410}','[-0.019035308,0.024417792,0.012571414,0.034629762,0.024860187,0.05908442,-0.021874014,-0.05185862,-0.0015960044,0.016847907,0.03730871,-0.023877084,-0.0035760328,0.064983025,-0.036817163,0.007526873,0.0057695787,0.0026497666,0.010850986,0.018789534,0.040258016,0.011502291,-0.005870961,0.02010443,-0.00013901673,-0.022463875,0.013345607,0.0053394716,0.041069075,0.009529943,0.05726568,-0.020841759,-0.03925034,-0.017462345,-0.026764946,0.06272189,-0.009062969,-0.058936954,0.0025760338,-0.020190453,-0.0075145843,-0.033720393,-0.035195045,-0.023508422,-0.0093579,-0.0022165873,0.016331779,-0.008122878,-0.008362509,0.00013066421,0.027182765,0.052792568,0.020940067,0.023262646,0.036817163,0.046574447,-0.0043379366,-0.005044541,0.032663558,0.0011697375,-0.020841759,0.02132102,-0.012694302,0.007821804,-0.053628203,-0.027551427,-0.017093683,0.056085955,0.0054347096,-0.011821799,-0.0221075,-0.015569874,0.062918514,-0.03263898,-0.033695813,0.0448786,0.09024874,0.0014646681,-0.0046973834,0.0020768025,-0.04694311,0.011625178,-0.03534251,0.027674315,0.015262655,0.03492469,-0.037579067,0.013763425,-0.06596613,-0.0314101,-0.0065314826,0.009093692,-0.021554507,0.042617463,0.07201221,0.0032811023,-0.010832553,-0.012645147,0.010138237,0.0029569857,0.016442377,-0.012036853,-0.008245766,-0.012448526,0.097572856,0.03342546,-0.06876797,-0.01511519,-0.023901662,-0.02592931,0.013148987,-0.044632822,0.010519189,-0.0045253406,-0.04431331,-0.03514589,-0.019895522,0.0013863271,0.017904742,-0.002625189,-0.031901654,-0.003834097,-0.013910891,-0.022660496,-0.0004646692,-0.028706573,0.002483868,0.0044792574,-0.056724973,0.022992292,0.03062362,-0.01861749,0.01671273,-0.04205218,0.008872493,-0.015754206,0.02411057,-0.020645138,0.002182793,-0.031090595,0.027379384,0.04242084,-0.0048325597,0.04222422,-0.029738829,0.015803361,-0.005969271,0.004774188,0.04043006,0.03986478,-0.01654068