	 ('(a) The ALJ must schedule at least one prehearing conference, and may schedule additional prehearing conferences as appropriate, upon reasonable notice, which may not be less than 14 business days, to the parties. (b) The ALJ may use prehearing conferences to discuss the following— (1) Simplification of the issues; (2) The necessity or desirability of amendments to the pleadings, including the need for a more definite statement; (3) Stipulations and admissions of fact or as to the contents and authenticity of documents; (4) Whether the parties can agree to submission of the case on a stipulated record; (5) Whether a party chooses to waive appearance at an oral hearing and to submit only documentary evidence (subject to the objection of the other party) and written argument; (6) Limitation of the number of witnesses; (7) Scheduling dates for the exchange of witness lists and of proposed exhibits; (8) Discovery of documents as permitted by this subpart; s (9) The time and place for the hearing; (10) The potential for the settlement of the case by the parties; and (11) Other matters as may tend to encourage the fair, just and expeditious disposition of the proceedings, including the protection of privacy of individually identifiable health information that may be submitted into evidence or otherwise used in the proceeding, if appropriate. (c) The ALJ must issue an order containing the matters agreed upon by the parties or ordered by the ALJ at a prehearing conference.',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','E','Procedures for Hearings','160.512','Prehearing conferences','{}','[-0.02934503,-0.007581998,0.044976532,0.019155784,-0.006521118,0.021409405,-0.035074983,-0.04269894,0.023183532,0.0314548,0.019803101,-0.024406243,0.014336869,0.027403079,-0.029057333,0.016350744,0.012251071,0.026707813,0.008505024,0.009122373,0.037376553,0.02066619,-0.018004999,0.00038265865,-0.01908386,-0.026875636,0.029920423,-0.006700928,0.078205466,-0.0102192145,0.020198682,-0.0241305