	 ('(a) A party may make a request to another party for production of documents for inspection and copying that are relevant and material to the issues before the ALJ. (b) For the purpose of this section, the term “documents” includes information, reports, answers, records, accounts, papers and other data and documentary evidence. Nothing contained in this section may be interpreted to require the creation of a document, except that requested data stored in an electronic data storage system must be produced in a form accessible to the requesting party. (c) Requests for documents, requests for admissions, written interrogatories, depositions and any forms of discovery, other than those permitted under paragraph (a) of this section, are not authorized. (d) This section may not be construed to require the disclosure of interview reports or statements obtained by any party, or on behalf of any party, of persons who will not be called as witnesses by that party, or analyses and summaries prepared in conjunction with the investigation or litigation of the case, or any otherwise privileged documents. (e)(1) When a request for production of documents has been received, within 30 days the party receiving that request must either fully respond to the request, or state that the request is being objected to and the reasons for that objection. If objection is made to part of an item or category, the part must be specified. Upon receiving any objections, the party seeking production may then, within 30 days or any other time frame set by the ALJ, file a motion for an order compelling discovery. The party receiving a request for production may also file a motion for protective order any time before the date the production is due. (2) The ALJ may grant a motion for protective order or deny a motion for an order compelling discovery if the ALJ finds that the discovery sought— (i) Is irrelevant; (ii) Is unduly costly or burdensome; (iii) Will unduly delay the proceeding; or (iv) Seeks privileged information. (3) The ALJ may extend any of the time frames set forth in paragraph (e)(1) of this section. (4) The burden of showing that discovery should be allowed is on the party seeking discovery.',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','E','Procedures for Hearings','160.516','Discovery','{}','[-0.018711962,0.013889417,0.03434832,0.014406119,0.0393677,0.012732991,-0.031002065,-0.042910796,-0.025293749,-0.0020483509,0.047561105,-0.027114505,0.03449595,-0.009841925,-0.021701446,0.032232307,0.06928716,0.0036445882,-0.030436154,0.021012511,0.0787354,0.024149625,-0.0444609,-0.010315568,-0.04441169,-0.017506326,0.027016087,-0.03363478,0.0444609,-0.007073884,0.01487361,-0.020791069,-0.025183028,-0.027360553,-0.01313897,0.05171932,-0.00030198565,-0.034151483,-0.0028510827,-0.0031986258,-0.00029371996,-0.01722337,-0.015611755,-0.040967014,-0.0037829902,-0.005191616,-0.0073875953,0.00018232552,-0.008574777,0.015131961,0.00705543,0.0051793135,0.01681739,0.049037393,0.036439728,-0.0055883685,-0.02111093,0.021418491,0.024469487,0.02407581,-0.013938627,0.026499385,-0.0033708594,-0.0010718472,-0.029968664,-0.047093615,-0.010727699,0.0700253,0.016226875,0.025133818,-0.010924538,0.014049348,0.03496344,-0.032896638,-0.0069693136,0.042098835,0.061315197,-0.015783988,-0.021295467,0.041163854,-0.034372926,0.030214712,-0.024813956,0.042689353,-0.017260278,0.0015639435,-0.05668949,0.033413336,-0.061118357,-0.06431698,-0.048742138,0.0029295108,-0.025515191,0.053490866,0.049554095,0.00421665,-0.0027695794,-0.0032017014,0.014086256,0.046699937,0.019351685,-0.06062626,-0.039072443,-0.029993268,0.05924839,0.034938835,-0.05294956,-0.019769968,0.010297115,-0.038186673,0.030706808,-0.045764953,0.0039982824,0.03786681,-0.009675843,-0.014947425,-0.036833405,-0.0337332,0.02135698,0.0060497085,-0.033044264,-0.0007731294,-0.012554606,-0.012308558,0.02836935,-0.025515191,0.030682202,-0.030239316,-0.029181309,0.04256633,0.019314779,-0.011914881,0.035283305,-0.050735127,-0.051276434,0.