	 ('(a) Forms. (1) Unless the ALJ directs the parties to do otherwise, documents filed with the ALJ must include an original and two copies. (2) Every pleading and paper filed in the proceeding must contain a caption setting forth the title of the action, the case number, and a designation of the paper, such as motion to quash subpoena. (3) Every pleading and paper must be signed by and must contain the address and telephone number of the party or the person on whose behalf the paper was filed, or his or her representative. (4) Papers are considered filed when they are mailed. (b) Service. A party filing a document with the ALJ or the Board must, at the time of filing, serve a copy of the document on the other party. Service upon any party of any document must be made by delivering a copy, or placing a copy of the document in the United States mail, postage prepaid and addressed, or with a private delivery service, to the party''s last known address. When a party is represented by an attorney, service must be made upon the attorney in lieu of the party. (c) Proof of service. A certificate of the natural person serving the document by personal delivery or by mail, setting forth the manner of service, constitutes proof of service.',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','E','Procedures for Hearings','160.524','Form, filing, and service of papers','{}','[0.008088547,0.020655774,0.039157864,0.023127614,0.038546022,0.014782094,-0.024522614,-0.047356542,-0.004065688,0.027728664,0.060107324,-0.003453846,0.046108387,-0.011777951,-0.03558471,0.07689626,0.060743637,0.0132769635,0.011655583,-0.021989588,0.06642153,0.004744832,0.008871703,-0.00087493355,-0.009875124,-0.02043551,-0.014109069,-0.05007312,0.024498139,0.0060449955,0.031864714,-0.023519192,-0.02480406,-0.015344989,-0.031571027,0.06926047,-0.0077214413,-0.01618933,-0.026260244,-0.0014003526,-0.013619595,-0.007874402,0.019187354,-0.010248347,-0.013374859,0.008792165,0.0065038768,0.0042400626,-0.018636696,0.03903549