	 ('(a) Standard. The standard unique health identifier for health care providers is the National Provider Identifier (NPI). The NPI is a 10-position numeric identifier, with a check digit in the 10th position, and no intelligence about the health care provider in the number. (b) Required and permitted uses for the NPI. (1) The NPI must be used as stated in § 162.410, § 162.412, and § 162.414. (2) The NPI may be used for any other lawful purpose.',162,'ADMINISTRATIVE REQUIREMENTS','D','Standard Unique Health Identifier for Health Care Providers','162.406','Standard unique health identifier for health care providers','{162.410,162.412,162.414}','[-0.003317257,-0.021505816,0.049956854,0.018959235,0.018618066,-0.01788699,-0.0075361743,-0.022748645,0.044717476,-0.014889579,0.017034069,-0.0046727937,-0.043450277,-0.019946188,0.030290913,-0.0019373512,0.017387422,-0.024941873,-0.012190691,0.020384833,0.028633807,0.04427883,-0.005784638,-0.022907045,0.0046057785,0.0098390635,-0.020750372,-0.031046357,0.039063822,0.022492768,0.002909073,-0.011362138,0.019921819,0.023467537,0.010795554,-0.016290808,-0.01473118,0.026343102,0.04098899,0.06628422,-0.03343454,-0.008376911,0.0034878412,0.009589279,-0.012105399,-0.008443926,0.036261365,-0.0600457,0.040794037,0.010235063,0.015242932,0.040257912,0.009607556,0.04610652,-0.016485762,0.02318729,0.012367368,0.0129887825,-0.028195161,0.0065065757,0.029901005,-0.021176832,-0.026318733,-0.0011925676,0.03886887,0.020214248,-0.0006949029,0.024393566,0.010070571,0.032094233,-0.020762555,0.07603189,-0.020226434,-0.0011445907,0.00805402,0.039283145,-0.028926237,-0.011343861,0.032069862,-0.0014659595,-0.023443168,0.016607609,-0.015194194,-0.03701681,-0.006415191,0.029681683,-0.045107383,-0.038820133,-0.07495965,0.007615374,-0.0058942996,-0.0018063667,-0.02018988,0.0385277,-0.010131494,-0.041841913,-0.051175315,0.022066308,-0.01070417,0.038893238,-0.018764282,0.029389251,-0.012446567,0.00016982284,0.012434383,0.029632945,0.0048616547,0.0037985486