	 ('(a) An application to the ALJ for an order or ruling must be by motion. Motions must state the relief sought, the authority relied upon and the facts alleged, and must be filed with the ALJ and served on all other parties. (b) Except for motions made during a prehearing conference or at the hearing, all motions must be in writing. The ALJ may require that oral motions be reduced to writing. (c) Within 10 days after a written motion is served, or such other time as may be fixed by the ALJ, any party may file a response to the motion. (d) The ALJ may not grant a written motion before the time for filing responses has expired, except upon consent of the parties or following a hearing on the motion, but may overrule or deny the motion without awaiting a response. (e) The ALJ must make a reasonable effort to dispose of all outstanding motions before the beginning of the hearing.',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','E','Procedures for Hearings','160.528','Motions','{}','[0.007966163,0.05464582,0.030922482,-0.0032190785,0.0071810214,0.038194098,-0.0501524,-0.051456943,-0.011952264,0.04519997,0.035005216,-0.022986516,0.0008832838,0.040126752,-0.039667744,0.04000596,0.045707293,-0.013154133,-0.015920246,0.016294697,0.07232962,-0.00266948,-0.028893193,-0.027105488,-0.028893193,-0.00960288,0.013057501,-0.022612065,0.018034087,-0.019688923,0.009965253,-0.011185241,-0.026984697,-0.025994211,0.002387131,0.049524285,-0.047664106,-0.034763634,-0.015026393,-0.029038142,-0.019773478,-0.0038351123,-0.025245307,0.0071568633,-0.01200058,-0.001586891,-0.006096923,0.007416564,-0.01441036,0.01786498,0.011233558,0.016995287,0.023964923,0.037034504,0.05237495,0.00333383,0.014011749,0.0042367424,0.042590886,0.018384382,-0.049403496,0.012181766,-0.03186465,-0.027540335,-0.03227534,-0.038218256,-0.022732856,0.026211634,0.03563333,0.034207996,-0.043798797,-0.023167703,0.07440722,-0.0028778443,-0.063294455,-0.0126226535,0.055563834,0.004254861,-0.00493733,0.06097527,-0.03717945,-0.0008