	 ('The ALJ may sanction a person, including any party or attorney, for failing to comply with an order or procedure, for failing to defend an action or for other misconduct that interferes with the speedy, orderly or fair conduct of the hearing. The sanctions must reasonably relate to the severity and nature of the failure or misconduct. The sanctions may include— (a) In the case of refusal to provide or permit discovery under the terms of this part, drawing negative factual inferences or treating the refusal as an admission by deeming the matter, or certain facts, to be established; (b) Prohibiting a party from introducing certain evidence or otherwise supporting a particular claim or defense; (c) Striking pleadings, in whole or in part; (d) Staying the proceedings; (e) Dismissal of the action; (f) Entering a decision by default; (g) Ordering the party or attorney to pay the attorney''s fees and other costs caused by the failure or misconduct; and (h) Refusing to consider any motion or other action that is not filed in a timely manner.',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','E','Procedures for Hearings','160.530','Sanctions','{}','[-0.03361202,0.04479978,0.037243776,0.047749057,-0.0014990133,0.02832282,-0.062056713,-0.04560413,-0.01723256,0.030613994,0.030906485,-0.0128939515,-0.008646747,0.007781463,0.020413391,-0.0029340442,0.012321158,0.018512204,0.0036744105,0.051283315,0.048724025,0.040412422,-0.0050302255,0.012327251,-0.009451096,-0.012881764,0.03634193,-0.04621348,0.06361666,0.019401863,0.05581692,-0.0045945365,-0.036073815,-0.020315895,-0.009731399,0.050064605,-0.022168335,-0.012869577,-0.05294076,-0.024557006,-0.032222692,-0.037755635,-0.01563605,-0.0053988853,0.011833674,0.015721358,0.032710176,0.011388845,-0.0053531835,-0.011772739,-0.01386892,0.00966437,0.010761209,0.05581692,0.03214957,-0.002225669,-0.014137036,0.00787896,0.021144617,-0.014807326,-0.03524509,-0.0014426479,-0.029200291,0.0041100993,-0.07955739,-0.048260916,-0.023338296,0.04945525,0