	 ('(a) The ALJ must conduct a hearing on the record in order to determine whether the respondent should be found liable under this part. (b) (1) The respondent has the burden of going forward and the burden of persuasion with respect to any: (i) Affirmative defense pursuant to § 160.410 of this part; (ii) Challenge to the amount of a proposed penalty pursuant to §§ 160.404-160.408 of this part, in cluding any factors raised as mitigating factors; or (iii) Claim that a proposed penalty should be reduced or waived pursuant to § 160.412 of this part; and (iv) Compliance with subpart D of part 164, as provided under § 164.414(b). (2) The Secretary has the burden of going forward and the burden of persuasion with respect to all other issues, including issues of liability other than with respect to subpart D of part 164, and the existence of any factors considered aggravating factors in determining the amount of the proposed penalty. (3) The burden of persuasion will be judged by a preponderance of the evidence. (c) The hearing must be open to the public unless otherwise ordered by the ALJ for good cause shown. (d)(1) Subject to the 15-day rule under § 160.518(a) and the admissibility of evidence under § 160.540, either party may introduce, during its case in chief, items or information that arose or became known after the date of the issuance of the notice of proposed determination or the request for hearing, as applicable. Such items and information may not be admitted into evidence, if introduced— (i) By the Secretary, unless they are material and relevant to the acts or omissions with respect to which the penalty is proposed in the notice of proposed determination pursuant to § 160.420 of this part, including circumstances that may increase penalties; or (ii) By the respondent, unless they are material and relevant to an admission, denial or exp lanation of a finding of fact in the notice of proposed determination under § 160.420 of this part, or to a specific circumstance or argument expressly stated in the request for hearing under § 160.504, including circumstances that may reduce penalties. (2) After both parties have presented their cases, evidence may be admitted in rebuttal even if not previously exchanged in accordance with § 160.518. [71 FR 8428, Feb. 16, 2006, as amended at 74 FR 42767, Aug. 24, 2009; 78 FR 5692, Jan. 25, 2013]',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','E','Procedures for Hearings','160.534','The hearing','{160.404,160.410,160.412,160.518,160.540,164.414}','[0.035805646,0.01531983,0.0529323,0.051736236,0.011311734,0.049140517,-0.04206591,-0.0150780715,0.004265758,0.055273537,0.057156704,-0.0052296096,-0.0010338341,0.023170605,0.002385771,-0.011897043,0.02804394,-0.0055890656,-0.014467314,0.003670906,0.063213386,-0.017063033,0.020473095,0.0336171,0.006979175,-0.03695082,-0.013042213,-0.01566338,0.034965858,-0.0011777756,0.04076805,-0.032293793,-0.032115657,0.0062507195,0.007316364,0.07100054,-0.025931738,-0.024124915,-0.003445053,-0.031555794,-0.009733945,-0.04422901,-0.006117116,-0.021058403,-0.030359728,0.009791203,0.020167716,-0.04081895,-0.0075072255,-0.014798141,0.013894729,0.051354513,0.046824727,0.026669737,0.021529196,0.04522149,-0.021287438,0.026288014,-0.00080519763,0.011585303,0.029952558,0.01817003,0.0032860017,0.013551178,-0.056444157,-0.011782527,-0.012062457,0.060261387,0.00541729,0.05522264,0.028934628,-0.014467314,0.09095194,-0.03463503,-0.025333704,0.030105246,0.061737385,-0.011521682,0.0064765722,0.024341224,-0.049725827,0.009867548,-0.04547597,0.004144879,-0.01875534,0.0072718295,-0.06845572,0.058480013,-0.074207015,-0.03476227,-0.015841518,0.013971074,-0.020065922,0.020867541,0.031708483,-0.011184493,-0.013691143,-0.0045266026,0.028680146,-0.012202422,0.04453439,-0.021567367,-0.0022633013,0.00036561937,0.05277961,0.041251566,-0.03348986,0.019582406,-0.011248114,-0.016426828,0.059039876,0.013945625,0.029163662,0.028552905,-0.036187373,0.001488721,-0.043872733,-0.01745748,0.00824522