	 ('(a) In meeting the burden of proof set forth in § 160.534, the Secretary may introduce the results of a statistical sampling study as evidence of the number of violations under § 160.406 of this part, or the factors considered in determining the amount of the civil money penalty under § 160.408 of this part. Such statistical sampling study, if based upon an appropriate sampling and computed by valid statistical methods, constitutes prima facie evidence of the number of violations and the existence of factors material to the proposed civil money penalty as described in §§ 160.406 and 160.408. (b) Once the Secretary has made a prima facie case, as described in paragraph (a) of this section, the burden of going forward shifts to the respondent to produce evidence reasonably calculated to rebut the findings of the statistical sampling study. The Secretary will then be given the opportunity to rebut this evidence.',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','E','Procedures for Hearings','160.536','Statistical sampling','{160.406,160.408,160.534}','[0.04426852,-0.03226786,0.067986555,0.055264827,-0.037469864,0.026473552,-0.021760847,-0.022417536,-0.00907775,0.022327403,0.052226037,0.020911016,-0.017550318,0.023730913,0.02199262,-0.012844051,0.010983434,-0.039684575,-0.012013533,-0.01716403,0.060415324,0.008202166,-0.0078094406,0.015477242,0.0026879155,-0.032525387,-0.0031498505,-0.03806217,0.045993935,-0.017485935,0.009599238,-0.030053148,-0.031263515,0.00373411,-0.020808006,0.046431728,0.0011556427,0.0019861602,-0.006727836,-0.057273522,0.01627557,-0.036980566,0.015567376,0.027555156,-0.023460511,-0.0042298455,0.006998237,-0.062887564,0.0041203974,-0.0052985735,-0.0028102398,0.036465514,0.045916677,-0.01747306,0.03703207,0.012097229,-0.017460184,-0.0067857793,-0.03618224,-0.015696138,0.035615683,3.938319e-05,-0.020988274,0.029203316,-0.03754712,-0.011125073,0.0024159048,0.04540163,0.016636103,0.043547448,0.021490447,0.025404824,0.09276044,-0.011401912,-0.016198311,-0.