	 ('(a) The hearing must be recorded and transcribed. Transcripts may be obtained following the hearing from the ALJ. A party that requests a transcript of hearing proceedings must pay the cost of preparing the transcript unless, for good cause shown by the party, the payment is waived by the ALJ or the Board, as appropriate. (b) The transcript of the testimony, exhibits, and other evidence admitted at the hearing, and all papers and requests filed in the proceeding constitute the record for decision by the ALJ and the Secretary. (c) The record may be inspected and copied (upon payment of a reasonable fee) by any person, unless otherwise ordered by the ALJ for good cause shown. (d) For good cause, the ALJ may order appropriate redactions made to the record.',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','E','Procedures for Hearings','160.542','The record','{}','[0.002636632,-0.0006610338,0.019304289,0.001898315,0.018067757,0.03527114,-0.0005724958,-0.032918133,-0.011002724,-0.010432479,0.06137035,0.0070050075,0.01763557,0.016447062,-0.025979154,0.0011464922,0.06127431,-0.0070950463,-0.01106275,0.029460648,0.022089483,-0.009694162,-0.021957427,-0.007899391,0.012533382,-0.027395763,-0.011194807,-0.038296442,0.02953268,0.018019736,0.0179357,-0.006698876,-0.0067589018,0.0003826643,-0.03527114,0.040961586,-0.01474233,-0.05997775,-0.008817785,-0.047660463,0.018632,0.0033254276,-0.041825958,-0.024370464,0.016663155,-0.0042888415,0.030108927,-0.013013587,-0.002687654,0.031453505,-0.005795488,0.037792224,0.0039256853,0.047612444,0.02264172,0.032630008,-0.001301809,0.032894123,0.016555108,-0.016459066,-0.028212113,0.03335032,-0.022857813,0.0060896147,-0.050181545,-0.030204969,-0.045067348,0.06290701,0.013481788,0.03805634,0.0010091832,-0.03971305,0.037480094,-0.038608577,-0.040289298,0.03332631,0.023542108,-0.00992226,-0.0058495114,0.027443783,-0.024970721,0.016218964,-0.0014818863,0.032317877,0.040121228,0.0023440064,-0.03892071,0.03178965,-0.024658587,-0.023518097,0.0032834096,