	 ('(a) Any party may appeal the decision of the ALJ to the Board by filing a notice of appeal with the Board within 30 days of the date of service of the ALJ decision. The Board may extend the initial 30 day period for a period of time not to exceed 30 days if a party files with the Board a request for an extension within the initial 30 day period and shows good cause. (b) If a party files a timely notice of appeal with the Board, the ALJ must forward the record of the proceeding to the Board. (c) A notice of appeal must be accompanied by a written brief specifying exceptions to the initial decision and reasons supporting the exceptions. Any party may file a brief in opposition to the exceptions, which may raise any relevant issue not addressed in the exceptions, within 30 days of receiving the notice of appeal and the accompanying brief. The Board may permit the parties to file reply briefs. (d) There is no right to appear personally before the Board or to appeal to the Board any interlocutory ruling by the ALJ. (e) Except for an affirmative defense under § 160.410(a)(1) or (2) of this part, the Board may not consider any issue not raised in the parties'' briefs, nor any issue in the briefs that could have been raised before the ALJ but was not. (f) If any party demonstrates to the satisfaction of the Board that additional evidence not presented at such hearing is relevant and material and that there were reasonable grounds for the failure to adduce such evidence at the hearing, the Board may remand the matter to the ALJ for consideration of such additional evidence. (g) The Board may decline to review the case, or may affirm, increase, reduce, reverse or remand any penalty determined by the ALJ. (h) The standard of review on a disputed issue of fact is whether the initial decision of the ALJ is supported by substantial evidence on the whole record. The standard of review on a disputed issue of law is whether the decision is erroneous. (i) Within 60 days after the time for submission of briefs and reply briefs, if permitted, has expired, the Board must serve on each party to the appeal a copy of the Board''s decision and a statement describing the right of any respondent who is penalized to seek judicial review. (j)(1) The Board''s decision under paragraph (i) of this section, including a decision to decline review of the initial decision, becomes the final decision of the Secretary 60 days after the date of service of the Board''s decision, except with respect to a decision to remand to the ALJ or if reconsideration is requested under this paragraph. (2) The Board will reconsider its decision only if it determines that the decision contains a clear error of fact or error of law. New evidence will not be a basis for reconsideration unless the party demonstrates that the evidence is newly discovered and was not previously available. (3) A party may file a motion for reconsideration with the Board before the date the decision becomes final under paragraph (j)(1) of this section. A motion for reconsideration must be accompanied by a written brief specifying any alleged error of fact or law and, if the party is relying on additional evidence, explaining why the evidence was not previously available. Any party may file a brief in opposition within 15 days of receiving the motion for reconsideration and the accompanying brief unless this time limit is extended by the Board for good cause shown. Reply briefs are not permitted. (4) The Board must rule on the motion for reconsideration not later than 30 days from the date the opposition brief is due. If the Board denies the motion, the decision issued under paragraph (i) of this section becomes the final decision of the Secretary on the date of service of the ruling. If the Board grants the motion, the Board will issue a reconsidered decision, after such procedures as the Board determines necessary to address the effect of any error. The Board''s decision on reconsideration becomes the final decision of the Secretary on the date of service of the decision, except with respect to a decision to remand to the ALJ. (5) If service of a ruling or decision issued under this section is by mail, the date of service will be deemed to be 5 days from the date of mailing. (k)(1) A respondent''s petition for judicial review must be filed within 60 days of the date on which the decision of the Board becomes the final decision of the Secretary under paragraph (j) of this section. (2) In compliance with 28 U.S.C. 2112(a), a copy of any petition for judicial review filed in any U.S. Court of Appeals challenging the final decision of the Secretary must be sent by certified mail, return receipt requested, to the General Counsel of HHS. The petition copy must be a copy showing that it has been time-stamped by the clerk of the court when the original was filed with the court. (3) If the General Counsel of HHS received two or more petitions within 10 days after the final decision of the Secretary, the General Counsel will notify the U.S. Judicial Panel on Multidistrict Litigation of any petitions that were received within the 10 day period.',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','E','Procedures for Hearings','160.548','Appeal of the ALJ''s decision','{160.410}','[0.0024261489,0.015717225,0.053111564,0.052425914,-0.009038723,0.070780255,-0.021373844,-0.01337019,0.002909071,0.029456612,0.030801542,-0.047837324,-0.039846856,0.049393225,-0.0081421025,0.004872076,0.039055724,-0.021162875,0.0043149847,0.005742325,0.041033562,-0.0025497638,0.0018740022,0.014293181,-0.0184862,-0.013264705,0.011511021,-0.054430123,0.01806426,-0.022046309,0.0614976,-0.016943485,-0.031539936,0.009513404,-0.02877096,0.048575718,-0.04530569,-0.022085866,0.0060258154,-0.002030581,0.036418606,-0.020912347,-0.01914548,0.021993566,-0.056328848,0.013198777,0.021782598,-0.024591127,-0.003860082,0.026041543,-0.00907828,0.07700385,-0.01638969,0.038501926,0.027267803,0.029219272,-0.0063126017,0.031091