	 ('(a) Pending judicial review, the respondent may file a request for stay of the effective date of any penalty with the ALJ. The request must be accompanied by a copy of the notice of appeal filed with the Federal court. The filing of the request automatically stays the effective date of the penalty until such time as the ALJ rules upon the request. (b) The ALJ may not grant a respondent''s request for stay of any penalty unless the respondent posts a bond or provides other adequate security. (c) The ALJ must rule upon a respondent''s request for stay within 10 days of receipt.',160,'GENERAL ADMINISTRATIVE REQUIREMENTS','E','Procedures for Hearings','160.550','Stay of the Secretary''s decision','{}','[0.0066836383,0.031030275,0.032723296,0.0057044663,-0.045281965,0.060342263,-0.0489965,-0.027214663,0.025407933,0.022388292,0.050133605,-0.036766328,-0.02212297,0.013329374,0.02235039,-0.0038629912,0.0013052993,0.005988742,-0.035351265,0.015704654,0.006494121,-0.008705155,-0.023411686,-0.008016576,0.014352766,-0.0070310864,-0.0021494403,-0.033759322,0.028377036,0.010398175,0.023272706,-0.018345261,-0.008762009,-0.021238556,0.021301728,0.06837779,-0.014074807,-0.01402427,-0.023323245,-0.036867402,-0.015224544,-0.014428573,0.0007853117,-0.0041914876,-0.045938957,0.009899112,0.05867451,-0.010853016,-0.011718477,0.011636353,0.01329147,0.041491624,-0.033203404,0.013935828,0.035048038,-0.012046974,-0.012703966,0.008275582,0.03454266,0.023121092,-0.011074119,0.057865903,-0.015717288,0.0034523709,-0.011851139,-0.04371529,0.0013645235,0.051599205,-0.03931849,0.007858644,-0.018901177,0.001862006,0.08278109,-0.043690022,-0.033178136,0.037802354,0.05776483,0.0070310864,0.02127646,0.052003507,-0.036867402,0.015060296,0.010379223,-0.002484254,0.008035528,0.035123847,-0.062970236,0.052812114,-0.029893173,-0.029387793,-0.00434626,0.036791597,-0.04252765,0.018345261,0.040026024,0.022666251,0.0021494403,0.014062173,0.035705034,-0.005574963,0.026507134,-0.062010013,-0.028377036,0.006449