	 ('(a) Health care providers. A covered health care provider must comply with the implementation specifications in § 162.410 no later than May 23, 2007. (b) Health plans. A health plan must comply with the implementation specifications in § 162.412 no later than one of the following dates: (1) A health plan that is not a small health plan—May 23, 2007. (2) A small health plan—May 23, 2008. (c) Health care clearinghouses. A health care clearinghouse must comply with the implementation specifications in § 162.414 no later than May 23, 2007. [69 FR 3468, Jan. 23, 2004, as amended at 77 FR 54719, Sept. 5, 2012]',162,'ADMINISTRATIVE REQUIREMENTS','D','Standard Unique Health Identifier for Health Care Providers','162.404','Compliance dates of the implementation of the standard unique health identifier for health care providers','{162.410,162.412,162.414}','[0.018329661,0.0005914998,0.07603415,-0.026763838,-0.01318631,0.016362071,0.011005851,-0.04602552,0.019883024,-0.0056668916,0.046692885,-0.029318254,-0.006288236,0.009671112,-0.0013469656,-0.025682239,0.027799413,-0.007939402,0.024416536,0.0061098873,0.059787147,0.02202321,0.0053936155,0.0344501,-0.028374732,-0.05481639,0.0030693267,-0.009550295,0.0063400147,-0.009383452,0.013347399,-0.00010346752,0.021516928,-0.0060466025,0.039835084,-0.013612047,0.0025285268,0.029732484,0.0041624326,0.022667566,-0.025429098,-0.016350565,-0.013819162,-0.016661238,-0.0061904322,0.0015821272,-0.005856747,-0.05458626,-0.037925027,0.015568131,0.013048234,-0.011696234,0.007904883,-0.03670535,-0.0037165605,-0.0014692208,0.02812159,0.045933466,-0.0023717524,0.017501203,0.011184201,-0.0029226204,-0.05932689,0.005661139,0.0062479638,0.022909202,0.0579001,0.005750313,0.0028550203,0.0047550113,-0.027132042,0.07718479,0.016971909,-0.027016979,-0.029341267,-0.0028981692,-0.005514432,0.06816379,0.05739382,0.021229269,-0.06374534,-0.013174804,-0.044598725,0.001625276,-0.022483464,0.013002208,-0.027500246,0.054448187,-0.067151226,0.0076574953,0.01595