	 ('National Provider System. The National Provider System (NPS) shall do the following: (a) Assign a single, unique NPI to a health care provider, provided that— (1) The NPS may assign an NPI to a subpart of a health care provider in accordance with paragraph (g); and (2) The Secretary has sufficient information to permit the assignment to be made. (b) Collect and maintain information about each health care provider that has been assigned an NPI and perform tasks necessary to update that information. (c) If appropriate, deactivate an NPI upon receipt of appropriate information concerning the dissolution of the health care provider that is an organization, the death of the health care provider who is an individual, or other circumstances justifying deactivation. (d) If appropriate, reactivate a deactivated NPI upon receipt of appropriate information. (e) Not assign a deactivated NPI to any other health care provider. (f) Disseminate NPS information upon approved requests. (g) Assign an NPI to a subpart of a health care provider on request if the identifying data for the subpart are unique.',162,'ADMINISTRATIVE REQUIREMENTS','D','Standard Unique Health Identifier for Health Care Providers','162.408','National Provider System','{}','[-0.013439034,-0.021045065,0.025284912,0.01990159,0.0047409213,0.017152112,-0.011158509,-0.047434907,0.017023632,-0.003126888,0.03556333,-0.0037098671,-0.04905376,-0.012417615,0.03733636,-0.03062969,0.004596381,0.0069636293,-0.005743067,-0.007753783,0.031888798,0.025413392,-0.0028072933,-0.031374875,-0.011967935,-0.0208138,-0.011010757,-0.004117792,0.015713135,0.022137146,0.021135,0.00011432735,-0.0035332069,0.040676847,0.035203587,0.013760234,-0.012629609,0.02516928,0.016432624,0.049798943,-0.0059133032,-0.03720788,-0.022997964,-0.0024266706,0.005852275,-0.0023447645,-0.011229173,-0.080274455,0.029961593,0.008845865,-0.0065974607,0.041807473,-0.0050460617,-0.0090000415,-0.030141465,0.027520468,0.015469022,0.001516067,-0.023910174,0.030449