	 ('The Enumeration System must do all of the following: (a) Assign a single, unique— (1) HPID to a health plan, provided that the Secretary has sufficient information to permit the assignment to be made; or (2) OEID to an entity eligible to receive one under § 162.514(a), provided that the Secretary has sufficient information to permit the assignment to be made. (b) Collect and maintain information about each health plan that applies for or has been assigned an HPID and each entity that applies for or has been assigned an OEID, and perform tasks necessary to update that information. (c) If appropriate, deactivate an HPID or OEID upon receipt of sufficient information concerning circumstances justifying deactivation. (d) If appropriate, reactivate a deactivated HPID or OEID upon receipt of sufficient information justifying reactivation. (e) Not assign a deactivated HPID to any other health plan or OEID to any other entity. (f) Disseminate Enumeration System information upon approved requests.',162,'ADMINISTRATIVE REQUIREMENTS','E','Standard Unique Health Identifier for Health Plans','162.508','Enumeration System','{162.514}','[0.02909823,-0.017425902,0.040275034,0.029593753,0.029621283,0.027295075,-0.00964894,-0.012959311,0.0056159305,0.020399043,0.084844604,-0.030612329,0.011624151,0.0008805002,0.067776576,-0.02244996,0.011665444,0.020426571,-0.025436863,0.03622826,0.011335095,0.039614335,0.007783845,-0.008651011,3.685777e-05,-0.020137517,-0.011149274,0.0049999678,0.04272512,-0.02534051,0.07625553,-0.007308969,0.004796941,0.041761603,0.022339841,0.0031778873,-0.03474169,0.029345991,0.03176855,0.043688636,0.01866471,-0.006620742,-0.007164441,-0.017742487,-0.009896701,0.003310371,0.02330336,-0.07295204,0.022009494,-0.010784514,0.002904317,0.032181486,0.0153336935,-0.0005247729,0.0019339173,0.032566894,0.022257255,0.02242243,-0.026716964,0.01902259,0.04679942,-0.008355074,-0.031520788,0.04126608,0.005722606,0.037714828,0.0039676274,0.031906195,0.018678475,0.009518176,