	 ('(a) A controlling health plan must do all of the following: (1) Obtain an HPID from the Enumeration System for itself. (2) Disclose its HPID, when requested, to any entity that needs the HPID to identify the health plan in a standard transaction. (3) Communicate to the Enumeration System any changes in its required data elements in the Enumeration System within 30 days of the change. (b) A controlling health plan may do the following: (1) Obtain an HPID from the Enumeration System for a subhealth plan of the controlling health plan. (2) Direct a subhealth plan of the controlling health plan to obtain an HPID from the Enumeration System. (c) A subhealth plan may obtain an HPID from the Enumeration System. (d) A subhealth plan that is assigned an HPID from the Enumeration System must comply with the requirements that apply to a controlling health plan in paragraphs (a)(2) and (a)(3) of this section.',162,'ADMINISTRATIVE REQUIREMENTS','E','Standard Unique Health Identifier for Health Plans','162.512','Implementation specifications: Health plans','{}','[0.0021517288,-0.022959823,0.07069018,0.054128207,0.007918846,0.03232724,-0.0013014489,-0.0153548345,0.020086827,0.011087591,0.067744754,-0.025398249,0.03355852,0.005896884,0.019929899,-0.03568309,0.029888812,0.027571103,-0.013194052,0.02670196,0.02713653,0.028271243,0.007393739,-0.024963677,-0.03227895,-0.01283191,-0.03693852,0.0017594082,0.02525339,-0.015173763,0.0380008,-0.006560812,-0.00876988,0.0041163513,0.0057309023,0.009240665,-0.048961643,0.026339818,0.028947243,0.020135112,0.0017111225,-0.014835764,-0.013592408,-0.030685525,0.023430608,0.014497764,0.0034282806,-0.06137105,0.006597026,-0.011751519,0.003337745,0.014884049,0.0010200342,-0.011667019,-0.00055603933,0.04336051,0.010182234,0.014075265,-0.034934662,0.015330692,0.01548762,-0.014533979,-0.044302076,0.026001818,0.033413664,0.0025349963,0.012602553,0.0024037196,0.012300768,-0.016730975,-0.0031204596,0.08266502,-0.001394248,-0.016730975,0.006385776,0.067