	 ('(a) An entity may obtain an Other Entity Identifier (OEID) to identify itself if the entity meets all of the following: (1) Needs to be identified in a transaction for which the Secretary has adopted a standard under this part. (2) Is not eligible to obtain an HPID. (3) Is not eligible to obtain an NPI. (4) Is not an individual. (b) An OEID must be obtained from the Enumeration System identified in § 162.508. (c) Uses for the OEID. (1) An other entity may use the OEID it obtained from the Enumeration System to identify itself or have itself identified on all covered transactions in which it needs to be identified. (2) The OEID may be used for any other lawful purpose.',162,'ADMINISTRATIVE REQUIREMENTS','E','Standard Unique Health Identifier for Health Plans','162.514','Other entity identifier','{162.508}','[0.012398219,-0.056328967,0.051804345,0.03924726,0.0032822553,0.03207904,-0.018822923,0.0032218846,0.013929727,-0.009773686,0.036451146,-0.040238608,0.0152642345,-0.021987615,0.04120454,0.01827641,0.051219705,-0.0039590416,-0.034976833,0.047661018,0.03304497,0.0481694,-0.026283462,-0.020945428,0.014234757,-0.034112576,-0.002403704,0.009360624,0.020055756,-0.01666229,0.05749825,-0.0064215274,0.019738015,-0.0071809264,-0.0101232,-0.015645523,-0.017551964,-0.018390797,0.01729777,0.023919474,-0.010974743,-0.023843218,0.0064850757,-0.006513672,-0.020805622,-0.021250458,0.049338683,-0.039958995,0.039603125,-0.0373154,0.022025743,0.0059639816,0.040924925,0.028647447,-0.037417077,-0.009398752,-0.01173732,0.0017364497,-0.048601527,0.010218522,0.029486282,0.0020541898,-0.021911358,0.02311877,0.055718906,0.05841334,-0.016802097,0.029384606,0.008420113,0.036374886,-0.005496904,0.046059605,0.005261776,0.018721247,0.05137222,0.043771878,-0.039577708,-0.009735557,0.0041719275,-0.021568198,0.0012939966,-0.004035299,-0.04720347,0.0017412158,0.013154441,0.0027897581,-0.0475085,0.0049059074,-0.036146116,0.016026812,-0.032816198,-0.016675001,-0.0106951315,-0.019445695,-0.00994526