	 ('(a) Health care providers. Health care providers must comply with the requirements of this subpart no later than July 30, 2004. (b) Health plans. A health plan must comply with the requirements of this subpart no later than one of the following dates: (1) Health plans other than small health plans —July 30, 2004. (2) Small health plans —August 1, 2005. (c) Health care clearinghouses. Health care clearinghouses must comply with the requirements of this subpart no later than July 30, 2004.',162,'ADMINISTRATIVE REQUIREMENTS','F','Standard Unique Employer Identifier','162.600','Compliance dates of the implementation of the standard unique employer identifier','{}','[0.0014788344,0.013619544,0.06510164,-0.0078084655,0.0055915858,0.040342823,0.031694796,-0.036150508,0.030290043,0.005207473,0.047278807,-0.03764306,0.030246144,0.010403971,-0.03189234,-0.03865273,0.0074024033,-0.003928926,0.030553434,-0.005679383,0.0600094,0.012928141,0.008006009,0.010661875,-0.02148837,-0.022937024,0.0026833026,-0.012686699,0.0072487583,-0.034877446,0.017285079,-0.0051361374,0.023244316,0.032792263,0.053819697,0.026141623,-0.012664749,0.030465636,0.02200418,0.011435588,-0.019809248,-0.015913246,-0.013630519,-0.030136397,0.012884242,0.017120458,-0.00055113336,-0.05662921,-0.030904623,0.01771309,-0.0029302323,-0.010442383,-0.00942174,-0.030465636,-0.02719519,0.019117845,0.024078388,0.052634437,0.009756466,-0.0076218965,0.016889991,0.002279984,-0.0600972,0.012203814,0.02280533,-0.022695582,0.026602559,-0.02750248,0.013696367,-0.019183693,-0.015605956,0.08555839,0.022673633,-0.012006271,-0.039706293,0.050702896,0.007385941,0.06650639,0.04295479,0.018733732,-0.06448706,0.01100209,-0.022629734,0.01757042,-0.034350663,-0.0017641755,-0.05351241,0.05724379,-0.08665586,0.0057232813,0.02785367,-0.0037780243,-0.066769786,-0.003470734,0.007929186,-0.006469558,-0.036787037,0.00847792,0.0127305975,0.020182386,0.006255552,-0.062775016,-0.020983536,-0.03393363,0.044842433,-0.00019737227,-0.0068207467,0.