	 ('(a) The standard unique employer identifier of an employer of a particular employee is the EIN that appears on that employee''s IRS Form W-2, Wage and Tax Statement, from the employer. (b) A covered entity must use the standard unique employer identifier (EIN) of the appropriate employer in standard transactions that require an employer identifier to identify a person or entity as an employer, including where situationally required. (c) Required and permitted uses for the Employer Identifier. (1) The Employer Identifier must be used as stated in § 162.610(b). (2) The Employer Identifier may be used for any other lawful purpose. [67 FR 38020, May 31, 2002, as amended at 69 FR 3469, Jan. 23, 2004]',162,'ADMINISTRATIVE REQUIREMENTS','F','Standard Unique Employer Identifier','162.610','Implementation specifications for covered entities. Subparts G-H [Reserved]','{}','[0.008751666,-0.022856746,0.034936838,0.054372057,0.032073926,-0.008158136,0.011736776,0.015303778,-0.013639566,0.010735921,0.008996061,-0.018806772,-0.0025632374,-0.026511032,0.034029085,0.037450615,0.043851435,-0.031259276,-0.0641013,0.026022242,0.026231723,0.025417075,-0.019889094,0.041733347,0.028861878,0.0031858627,-0.03226013,-0.022693817,0.010636999,-0.020273142,0.03163169,-0.0065171984,0.001131054,-0.013162414,-0.0027799925,-0.0028032681,0.0064240955,0.014954642,0.028233435,0.019889094,-0.008152317,0.007099091,0.020354608,-0.008536366,-0.020156763,-0.02544035,-0.012766726,-0.045038495,0.065823704,-0.0058596595,0.050787598,0.035495456,0.024486046,0.02895498,-0.038707502,0.004236179,-0.020005472,0.020517537,-0.029769631,-0.0074482267,0.023054589,0.03358685,-0.0046522324,0.0038434013,0.0017485876,0.04073249,-0.01702618,0.07401676,0.007337667,0.032353234,0.0041896277,0.07364434,0.028838603,0.00846072,0.049111746,0.037194584,-0.033749778,-0.0050566476,-0.014489128,0.019074444,-0.020238228,0.0059411246,-0.033773053,-0.022379594,-0.020878311,0.023950703,-0.010613723,0.008431626,-0.022693817,0.009863081