	 ('(a) Designation of DSMOs. (1) The Secretary may designate as a DSMO an organization that agrees to conduct, to the satisfaction of the Secretary, the following functions: (i) Maintain standards adopted under this subchapter. (ii) Receive and process requests for adopting a new standard or modifying an adopted standard. (2) The Secretary designates a DSMO by notice in the FEDERAL REGISTER. (b) Maintenance of standards. Maintenance of a standard by the appropriate DSMO constitutes maintenance of the standard for purposes of this part, if done in accordance with the processes the Secretary may require. (c) Process for modification of existing standards and adoption of new s tandards. The Secretary considers a recommendation for a proposed modification to an existing standard, or a proposed new standard, only if the recommendation is developed through a process that provides for the following: (1) Open public access. (2) Coordination with other DSMOs. (3) An appeals process for each of the following, if dissatisfied with the decision on the request: (i) The requestor of the proposed modification. (ii) A DSMO that participated in the review and analysis of the request for the proposed modification, or the proposed new standard. (4) Expedited process to address content needs identified within the industry, if appropriate. (5) Submission of the recommendation to the National Committee on Vital and Health Statistics (NCVHS).',162,'ADMINISTRATIVE REQUIREMENTS','I','General Provisions for Transactions','162.910','Maintenance of standards and adoption of modifications and new standards','{}','[0.033330265,0.048678678,0.05671199,0.037027717,-0.012342572,0.06112765,-0.014377501,-0.065702915,0.009369981,-0.0116044115,0.042693596,-0.022477314,-0.04375761,0.018221254,0.016691733,-0.0066633928,0.013552889,0.019963577,0.018487258,0.016026724,0.056445986,0.0646921,-0.021346798,0.020974392,0.0104273455,-0.033516467,0.007933561,-0.0031105808,0.009177128,0.0013075745,0.010360844,-0.0