	 ('(a) General rule. Except as otherwise provided in this part, if a covered entity conducts, with another covered entity that is required to comply with a transaction standard adopted under this part (or within the same covered entity), using electronic media, a transaction for which the Secretary has adopted a standard under this part, the covered entity must conduct the transaction as a standard transaction. (b) Exception for direct data entry transactions. A health care provider electing to use direct data entry offered by a health plan to conduct a transaction for which a standard has been adopted under this part must use the applicable data content and data condition requirements of the standard when conducting the transaction. The health care provider is not required to use the format requirements of the standard. (c) Use of a business associate. A covered entity may use a business associate, including a health care clearinghouse, to conduct a transaction covered by this part. If a covered entity chooses to use a business associate to conduct all or part of a transaction on behalf of the covered entity, the covered entity must require the business associate to do the following: (1) Comply with all applicable requirements of this part. (2) Require any agent or subcontractor to comply with all applicable requirements of this part. [65 FR 50367, Aug. 17, 2000, as amended at 74 FR 3325, Jan. 16, 2009]',162,'ADMINISTRATIVE REQUIREMENTS','I','General Provisions for Transactions','162.923','Requirements for covered entities','{}','[-0.015569656,0.0036039792,0.038388062,0.0173294,0.0254755,0.047105204,-0.0050374134,-0.016187316,0.02659428,-0.0027867472,0.0018107301,-0.009497956,0.018226754,0.038015135,-0.0043906197,0.0050082784,0.058549367,-0.02144324,0.020557541,0.0018908508,0.068012364,0.05458703,0.010593426,-0.02876191,-0.03862114,-0.051463775,-0.0036709893,0.004565429,-0.0012367738,-0.026547663,0.010692485,-0.0066602235,0.020312808,-0.005567667,0.017853828,0.018