	 ('The Secretary adopts the following maintaining organization''s code sets as the standard medical data code sets: (a) For the period from October 16, 2002 through October 15, 2003: (1) International Classification of Diseases, 9th Edition, Clinical Modification, (ICD-9- CM), Volumes 1 and 2 (including The Official ICD-9- CM Guidelines for Coding and Reporting), as maintained and distributed by HHS, for the following conditions: (i) Diseases. (ii) Injuries. (iii) Impairments. (iv) Other health problems and their manifestations. (v) Causes of injury, disease, impairment, or other health problems. (2) International Classification of Diseases, 9th Edition, Clinical Modification, Volume 3 Procedures (including The Official ICD-9-CM Guidelines for Coding and Reporting), as maintained and distributed by HHS, for the following procedures or other actions taken for diseases, injuries, and impairments on hospital inpatients reported by hospitals: (i) Prevention. (ii) Diagnosis. (iii) Treatment. (iv) Management. (3) National Drug Codes (NDC), as maintained and distributed by HHS, in collaboration with drug manufacturers, for the following: (i) Drugs (ii) Biologics. (4) Code on Dental Procedures and Nomenclature, as maintained and distributed by the American Dental Association, for dental services. (5) The combination of Health Care Financing Administration Common Procedure Coding System (HCPCS), as maintained and distributed by HHS, and Current Procedural Terminology, Fourth Edition (CPT-4), as maintained and distributed by the American Medical Association, for physician services and other health care services. These services include, but are not limited to, the following: (i) Physician services. (ii) Physical and occupational therapy services. (iii) Radiologic procedures. (iv) Clinical laboratory tests. (v) Other medical diagnostic procedures. (vi) Hearing and vision services. (vii) Transportation services including ambulance. (6) The Health Care Financing Administration Common Procedure Coding System (HCPCS), as maintained and distributed by HHS, for all other substances, equipment, supplies, or other items used in health care services. These items include, but are not limited to, the following: (i) Medical supplies. (ii) Or thotic and prosthetic devices. (iii) Durable medical equipment. (b) For the period on and after October 16, 2003 through September 30, 2014: (1) The code sets specified in paragraphs (a)(1), (a)(2),(a)(4), and (a)(5) of this section. (2) National Drug Codes (NDC), as maintained and distributed by HHS, for reporting the following by retail pharmacies: (i) Drugs. (ii) Biologics. (3) The Healthcare Common Procedure Coding System (HCPCS), as maintained and distributed by HHS, for all other substances, equipment, supplies, or other items used in health care services, with the exception of drugs and biologics. These items include, but are not limited to, the following: (i) Medical supplies. (ii) Orthotic and prosthetic devices. (iii) Durable medical equipment. (c) For the period on and after October 1, 2014: (1) The code sets specified in paragraphs (a)(4), (a)(5), (b)(2), and (b)(3) of this section. (2) International Classification of Diseases, 10th Revision, Clinical Modification (ICD-10 - CM) (including The Official ICD-10-CM Guidelines for Co din g and Reporting), as maintained and distributed by HHS, for the following conditions: (i) Diseases. (ii) Injuries. (iii) Impairments. (iv) Other health problems and their manifestations. (v) Causes of injury, disease, impairment, or other health problems. (3) International Classification of Diseases, 10th Revision, Procedure Coding System (ICD- 10-PCS) (including The Official ICD-10 -PCS Guidelines for Cod ing and Reporting), as maintained and distributed by HHS, for the following procedures or other actions taken for diseases, injuries, and impairments on hospital inpatients reported by hospitals: (i) Prevention. (ii) Diagnosis. (iii) Treatment. (iv) Management. [65 FR 5