	 ('T he eligibility for a health plan transaction is the transmission of either of the following: (a) An inquiry from a health care provider to a health plan, or from one health plan to another health plan, to obtain any of the following information about a benefit plan for an enrollee: (1) Eligibility to receive health care under the health plan. (2) Coverage of health care under the health plan. (3) Benefits associated with the benefit plan. (b) A response from a health plan to a health care provider''s (or another health plan''s) inquiry described in paragraph (a) of this section.',162,'ADMINISTRATIVE REQUIREMENTS','L','Eligibility for a Health Plan','162.1201','Eligibility for a health plan transaction','{}','[-0.011140246,-0.023575466,0.017285591,0.0045988923,0.00805312,0.02150582,-0.016603418,0.017701833,0.03450181,0.005564342,0.05184521,0.004801232,0.040028572,-0.0043705376,0.012521937,-0.014522209,0.015412504,0.04210978,-0.032651845,0.0134700425,0.06539619,0.04580971,0.004494832,-0.023425156,-0.028165685,-0.060678784,-0.006289874,-0.0092729395,-0.0057782438,-0.030385641,0.052908942,-0.023378907,0.0038646883,0.0043358505,0.0070934515,0.031472493,-0.034270562,0.013643477,0.052122705,-0.02446576,0.0038444542,0.020118346,-0.015481877,0.019563358,0.0043676468,-0.013840036,-0.0051509906,-0.04280352,0.022511737,0.027818818,-0.011394615,0.0005676351,0.0023818272,-0.022511737,0.011232744,0.013238797,0.012221318,0.0014669629,-0.060077548,-0.007018297,-0.003185405,0.00912263,-0.042341027,0.009371218,0.0046711564,0.013932534,0.037438624,0.024835752,0.010348231,0.035380542,0.021794876,0.047359053,-0.009712306,0.0068737688,0.013770661,0.06659867,-0.044537857,0.01896212,-0.010793378,-0.0099898,0.01564375,0.006584712,-0.01977148,-0.025575738,-0.022847041,0.03780862,-0.03686051,0.0019410158,-0.059152566,-0.027356327,-0.022280492,-0.00022438027,-0.0054573906,0.03043189,0.04562471,0.005428485,-0.018314634,-0.045485962,-0.052955188,0.049764004,0.016175613,-0.037323,-0.03776237