	 ('The Secretary adopts the following standards for the referral certification and authorization transaction: (a) For the period from October 16, 2003 through March 16, 2009: (1) Retail pharmacy drug referral certification and authorization. The NCPDP Telecommunication Standard Implementation Guide, Version 5, Release 1 (Version 5.1), September 1999, and equivalent NCPDP Batch Standard Batch Implementation Guide, Version 1, Release 1 (Version 1.1), January 2000, supporting Telecommunications Standard Implementation Guide, Version 5, Release 1 (Version 5.1) for the NCPDP Data Record in the Detail Data Record. (Incorporated by reference in § 162.920). (2) Dental, professional, and institutional referral certification and authorization. The ASC X12N 278—Health Care Services Review—Request for Review and Response, Version 4010, May 2000, Washington Publishing Company, 004010X094 and Addenda to Health Care Services Review—Request for Review and Response, Version 4010, October 2002, Washington Publishing Company, 004010X094A1. (Incorporated by reference in § 162.920). (b) For the period from March 17, 2009 through December 31, 2011 both— (1) The standards identified in paragraph (a) of this section; and (2)(i) Retail pharmacy drugs. The Telecommunication Standard Implementation Guide Version D, Release 0 (Version D.0), August 2007, and equivalent Batch Standard Implementation Guide, Version 1, Release 2 (Version 1.2), National Council for Prescription Drug Programs. (Incorporated by reference in § 162.920.) (ii) Dental, professional, and institutional request for review and response. The ASC X12 Standards for Electronic Data Interchange Technical Report Type 3—Health Care Services Review—Request for Review and Response (278), May 2006, ASC X12N/005010X217, and Errata to Health Care Services Review-—Request for Review and Response (278), ASC X12 Standards for Electronic Data Interchange Technical Report Type 3, April 2008, ASC X12N/005010X217E1. (Incorporated by reference in § 162.920.) (c) For the period on and after January 1, 2012, the standards identified in paragraph (b)(2) of this section. [68 FR 8398, Feb. 20, 2003, as amended at 74 FR 3326, Jan. 16, 2009]',162,'ADMINISTRATIVE REQUIREMENTS','M','Referral Certification and Authorization','162.1302','Standards for referral certification and authorization transaction','{162.920}','[-0.03691963,0.0069484306,0.05818742,0.00014929539,-0.014390857,0.029509706,-0.010614394,-0.010458396,0.00039162108,0.0014389232,0.043887563,-0.05511945,-0.03803762,0.02207378,0.0003684651,-0.0038544615,0.035359647,0.010887392,-0.030809693,0.024647754,0.065727346,0.049399506,-0.020721793,-0.019486805,-0.038921613,-0.04786552,0.0010408021,0.012889371,0.02919771,-0.011420386,-0.008586414,-0.024530755,0.017081829,0.023477767,-0.0077934223,0.02709173,-0.019265808,0.026909731,0.02616874,0.0030582196,-0.011537385,-0.008625414,0.012733373,0.002317227,-0.031225689,0.016314838,-0.0032272178,-0.06843132,0.046721533,0.003202843,-0.04310757,0.008092419,0.0043874565,0.0018183569,-0.030887691,0.0058401916,-0.0002953408,0.011205888,0.003118344,0.009054409,-0.008118419,-0.044667553,-0.06791132,-0.006636434,-0.016379837,-0.003522965,-0.0074944254,0.017536825,0.049113512,0.021553785,-0.0015445472,0.05730343,-0.0012528625,-0.012213378,-0.030783692,0.04131359,-0.010965391,0.08205518,0.05735543,-0.007695923,-0.018745814,0.0073124273,-0.059851404,0.0031947182,-0.03533365,0.033227667,-0.016743833,0.01912281,-0.05324747,0.010802892,-0.016847832,0.01196638,-0.0074684257,0.04409556,0.033409666,-0.028157718,-0.06359537,0.009697903,0.013402866,0.0027332227,0.010081399,-0.00703293,-0.034449656,-0.021995781,0.04898351,-0.004614954,-0.013610864,0.02416676,-0.012941371,0.015677843,-0.028911712,0.001702983,-0.0007803985,0.03712763,0.0132533675,-0.004933451,-0.059643406,-0.025843743,-0.029873703,0.04139159,-0.002505725,0.017575825,-0.0033572165,-0.07571124,0.022892771,0.005212948,0.013896861,-0.025895743,-0.035723645,-0.05506745,0.0918