	 ('The Secretary adopts the following standards for enrollment and disenrollment in a health plan transaction. (a) For the period from October 16, 2003 through March 16, 2009: ASC X12N 834—Benefit Enrollment and Maintenance, Version 4010, May 2000, Washington Publishing Company, 004010X095 and Addenda to Benefit Enrollment and Maintenance, Version 4010, October 2002, Washington Publishing Company, 004010X095A1. (Incorporated by reference in § 162.920.) (b) For the period from March 17, 2009 through December 31, 2011, both: (1) The standard identified in paragraph (a) of this section; and (2) The ASC X12 Standards for Electronic Data Interchange Technical Report Type 3— Benefit Enrollment and Maintenance (834), August 2006, ASC X12N/005010X220 (Incorporated by reference in § 162.920) (c) For the period on and after January 1, 2012, the standard identified in paragraph (b)(2) of this section. [74 FR 3327, Jan. 16, 2009]',162,'ADMINISTRATIVE REQUIREMENTS','O','Enrollment and Disenrollment in a Health Plan','162.1502','Standards for enrollment and disenrollment in a health plan transaction.HIPAA Administrative Simplification Regulation Text March 2013 38','{162.920}','[-0.020161593,0.003445257,0.04793509,0.010366865,0.00950866,0.031392884,0.0005841856,-0.038780905,0.01144273,0.016778525,0.020547165,-0.056268383,0.0030721244,0.030422738,0.020049654,0.024527244,0.016703898,0.004384307,-0.05164154,0.007531058,0.0620395,0.046815693,0.018693939,-0.005811539,-0.014887988,-0.049228616,-0.0383829,-0.007910409,-0.0057648974,-0.018233743,0.015410373,-0.01619395,0.018494936,0.018606875,-0.021504872,0.00868155,-0.00796016,0.041218705,0.037014745,-0.036243606,0.02211432,0.0026399125,-0.010087016,0.028482448,-0.008501203,0.0026616787,-0.00824001,-0.079253346,0.0520893,0.02050985,-0.044999782,-0.004717017,0.025037192,-0.006131811,-0.006473849,0.036442608,0.015522312,0.024253614,-0.029601846,0.02261183,-0.0024797765,-0.026989918,-0.06298477,0.02753718,0.03273616,0.03223865,-0.00448069