	 ('The health care electronic funds transfers (EFT) and remittance advice transaction is the transmission of either of the following for health care: (a) The transmission of any of the following from a health plan to a health care provider: (1) Payment. (2) Information about the transfer of funds. (3) Payment processing information. (b) The transmission of either of the following from a health plan to a health care provider: (1) Explanation of benefits. (2) Remittance advice. [65 FR 50367, Aug. 17, 2000, as amended at 77 FR 1590, Jan. 10, 2012; 77 FR 48043, Aug. 10, 2012]',162,'ADMINISTRATIVE REQUIREMENTS','P','Health Care Electronic Funds Transfers (EFT) and Remittance Advice','162.1601','Health care electronic funds transfers (EFT) and remittance advice transaction','{}','[-0.0029647744,-0.036478996,0.028922958,0.013126046,-0.007915577,0.027325004,-0.0069682184,0.01538601,-0.0030703535,0.0057298047,0.05204763,-0.011345469,0.026115125,-0.01729214,0.034721248,0.0077671953,0.044445936,-0.022588214,-0.0048281024,0.053462956,0.0339451,0.024836762,0.003592542,-0.003552593,-0.032758046,-0.051408447,-0.016584475,-0.049445245,-0.016561646,-0.018992819,0.028055498,-0.01608226,0.042140316,-0.045518845,0.03556588,0.047847293,-0.06665749,0.031570993,0.028215293,-0.018422121,0.024174754,0.010837548,-0.0039264,0.0064660045,-0.052732464,0.015249042,-0.01663013,-0.060220018,0.043898065,0.022188725,-0.023718195,0.017680215,-0.028717507,0.01784001,0.005861065,0.0021201419,9.220334e-05,0.025841191,-0.0022157338,-0.022508316,0.008229461,0.017543247,-0.039766215,-0.034082066,-0.014849554,0.0025110696,-0.03958359,0.06400945,0.0074533117,-0.00423743,-0.008897177,0.04015429,0.030201321,-0.00288345,0.0103695765,-0.005912428,0.005615665,-0.0025353243,0.048623443,-0.02999587,0.0055243536,-0.030520912,-0.06382683,-0.014267442,-0.008195219,-5.4951943e-06,-0.05067795,-0.047892947,-0.046203684,-0.009816,-0.018228084,-0.00533317,0.012018893,0.03412772,0.012897767,0.002833514,-0.08706564,-0.03376