	 ('On and after January 1, 2014, the Secretary adopts the following for the health care electronic funds transfers (EFT) and remittance advice transaction: (a) The Phase III CORE EFT & ERA Operating Rule Set, Approved June 2012 (Incorporated by reference in § 162.920) which includes the following rules: (1) Phase III CORE 380 EFT Enrollment Data Rule, version 3.0.0, June 2012. (2) Phase III CORE 382 ERA Enrollment Data Rule, version 3.0.0, June 2012. (3) Phase III 360 CORE Uniform Use of CARCs and RARCs (835) Rule, version 3.0.0, June 2012. (4) CORE-required Code Combinations for CORE- defined Business Scenarios for the Phase III CORE 360 Uniform Use of Claim Adjustment Reason Codes and Remittance Advice Remark Codes (835) Rule, version 3.0.0, June 2012. (5) Phase III CORE 370 EFT & ERA Reassociation (CCD+/835) Rule, version 3.0.0, June 2012. (6) Phase III CORE 350 Health Care Claim Payment/Advice (835) Infrastructure Rule, version 3.0.0, June 2012, except Requirement 4.2 titled “Health Care Claim Payment/Advice Batch Acknowledgement Requirements”. (b) ACME Health Plan, CORE v5010 Master Companion Guide Template, 005010, 1.2, March 2011 (incorporated by reference in § 162.920), as required by the Phase III CORE 350 Health Care Claim Payment/Advice (835) Infrastructure Rule, version 3.0.0, June 2012. [77 FR 48043, Aug. 10, 2012]',162,'ADMINISTRATIVE REQUIREMENTS','P','Health Care Electronic Funds Transfers (EFT) and Remittance Advice','162.1603','Operating rules for health care electronic funds transfers (EFT) and remittance advice transaction','{162.920}','[0.0071599795,0.01724483,0.05902682,0.007815097,0.015100807,0.0479626,-0.00738497,-0.019177098,-0.007537169,0.010164259,0.055109344,-0.04102761,-0.009820157,0.031578023,0.012387691,0.012705324,0.05468583,-0.006660369,-0.028507572,0.046374433,0.051403623,0.002322692,0.007193066,-0.00678279,-0.050450724,-0.0055056405,0.0017668342,0.0038380667,-0.027501732,-0.009641488,0.0063989838,-0.0075901076,0.019838834,-0.01958