	 ('The Secretary adopts the following standards for the coordination of benefits information transaction. (a) For the period from October 16, 2003 through March 16, 2009: (1) Retail pharmacy drug claims. The National Council for Prescription Drug Programs Telecommunication Standard Implementation Guide, Version 5, Release 1 (Version 5.1), September 1999, and equivalent NCPDP Batch Standard Batch Implementation Guide, Version 1, Release 1 (Version 1.1), January 2000, supporting Telecommunications Standard Implementation Guide, Version 5, Release 1 (Version 5.1) for the NCPDP Data Record in the Detail Data Record. (Incorporated by reference in § 162.920). (2) Dental health care claims. The ASC X12N 837—Health Care Claim: Dental, Version 40 10, May 2000, Washington Publishing Company, 004010X097 and Addenda to Health Care Claim: Dental, Version 4010, October 2002, Washington Publishing Company, 004010X097A1. (Incorporated by reference in § 162.920). (3) Professional health care claims. The ASC X12N 837— Health Care Claim: Professional, Volumes 1 and 2, Version 4010, May 2000, Washington Publishing Company, 004010X098 and Addenda to Health Care Claim: Professional, Volumes 1 and 2, Version 4010, October 2002, Washington Publishing Company, 004010X098A1. (Incorporated by reference in § 162.920). (4) Institutional health care claims. The ASC X12N 837— Health Care Claim: Institutional, Volumes 1 and 2, Version 4010, May 2000, Washington Publishing Company, 004010X096 and Addenda to Health Care Claim: Institutional, Volumes 1 and 2, Version 4010, October 2002, Washington Publishing Company, 004010X096A1. (Incorporated by reference in § 162.920). (b) For the period from March 17, 2009 through December 31, 2011, both: (1) The standards identified in paragraph (a) of this section; and (2)(i) Retail pharmacy drug claims. The Telecommunication Standard Implementation Guide, Version D, Release 0 (Version D.0), August 2007, and equivalent Batch Standard Implementation Guide, Version 1, Release 2 (Version 1.2), National Council for Prescription Drug Programs. (Incorporated by reference in § 162.920.) (ii) The ASC X12 Standards for Electronic Data Interchange Technical Report Type 3— Health Care Claim: Dental (837), May 2006, ASC X12N/005010X224, and Type 1 Errata to Health Care Claim: Dental (837), ASC X12 Standards for Electronic Date Interchange Technical Report Type 3, October 2007, ASC X12N/005010X224A1. (Incorporated by reference in § 162.920.) (iii) The ASC X12 Standards for Electronic Data Interchange Technical Report Type 3— Health Care Claim: Professional (837), May 2006, ASC X12N/005010X222. (In corporated by reference in § 162.920.) (iv) The ASC X12 Standards for Electronic Data Interchange Technical Report Type 3— Health Care Claim: Institutional (837), May 2006, ASC X12N/005010X223, and Type 1 Errata to Health Care Claim: Institutional (837), ASC X12 Standards for Electronic Data Interchange Technical Report Type 3, October 2007, ASC X12N/005010X223A1. (Incorporated by reference in § 162.920.) (c) For the period on and after January 1, 2012, the standards identified in paragraph (b)(2) of this section. [68 FR 8399, Feb. 20, 2003, as amended at 74 FR 3327, Jan. 16, 2009]',162,'ADMINISTRATIVE REQUIREMENTS','R','Coordination of Benefits','162.1802','Standards for coordination of benefits information transaction','{162.920}','[-0.018605974,-0.020710299,0.05908096,0.024439486,-0.007265253,0.027888982,-0.019871233,-0.027209738,0.0015840715,-0.029593753,0.032017723,-0.055405047,-0.014716965,0.018512744,-0.0121531505,0.018872343,0.020017736,0.017873455,-0.033456124,0.017061025,0.05050383,0.049917817,-0.021522729,-0.027089871,-0.041926704,-0.052794617,-0.029993309,-0.0041021043,0.010435061,-0.012665913,-0.017087663,-0.027862346,0.035267442,0.0041354005,-0.010115417,0.019138714,-0.017993322,0.046934467,0.045016598,-0.013718076,0.0006089061,0.006725853,0.001309377,0.0029500523,-0.056577075,0.03843725,0.016781336,-0.06462146,0.016861247,0.0