	 ('As used in this part, the following terms have the following meanings: Common control exists if an entity has the power, directly or indirectly, significantly to influence or direct the actions or policies of another entity. Common ownership exists if an entity or entities possess an ownership or equity interest of 5 percent or more in another entity. Covered functions means those functions of a covered entity the performance of which makes the entity a health plan, health care provider, or health care clearinghouse. Health care component means a component or combination of components of a hybrid entity designated by the hybrid entity in accordance with § 164.105(a)(2)(iii)(D). Hybrid entity means a single legal entity: (1) That is a covered entity; (2) Whose business activities include both covered and non- covered functions; and (3) That designates health care components in accordance with paragraph § 164.105(a)(2)(iii)(D). Law enforcement official means an officer or employee of any agency or authority of the United States, a State, a territory, a political subdivision of a State or territory, or an Indian tribe, who is empowered by law to: (1) Investigate or conduct an official inquiry into a potential violation of law; or (2) Prosecute or otherwise conduct a criminal, civil, or administrative proceeding arising from an alleged violation of law. Plan sponsor is defined as defined at section 3(16)(B) of ERISA, 29 U.S.C. 1002(16)(B). Required by law means a mandate contained in law that compels an entity to make a use or disclosure of protected health information and that is enforceable in a court of law. Required by law includes, but is not limited to, court orders and court-ordered warrants; subpoenas or summons issued by a court, grand jury, a governmental or tribal inspector general, or an administrative body authorized to require the production of information; a civil or an authorized investigative demand; Medicare conditions of participation with respect to health care providers participating in the program; and statutes or regulations that require the production of information, including statutes or regulations that require such information if payment is sought under a government program providing public benefits. [68 FR 8374, Feb. 20, 2003, as amended at 74 FR 42767, Aug. 24, 2009]',164,'SECURITY AND PRIVACY','A','General Provisions','164.103','Definitions','{164.105}','[0.01994724,0.018452454,0.010048988,0.05521919,0.03579952,0.037608337,-0.034417782,-0.022748396,0.039567888,0.031503577,0.025976634,-0.027333247,0.031001128,-0.013252103,0.005146966,-0.010689611,0.06165054,-0.02595151,0.018929781,-0.0012545533,0.0551187,0.04177867,0.005234895,0.026353471,-0.023765856,-0.03378972,-0.026127368,-0.014093705,0.032910436,0.014269562,0.05391282,-0.009245069,-0.0024855544,-0.019733699,0.02665494,0.004945986,-0.023376457,0.02715739,0.015990451,0.03255872,-0.0018213791,-0.03549805,0.005027634,0.0060576554,-0.053862575,-0.021793742,-0.029870616,-0.06476573,-0.015500564,0.022421803,-0.04353724,-0.030347943,0.019922119,-0.02430599,-0.0012945923,0.02218314,0.010714733,0.02919231,-0.05014445,0.018351965,0.0049051624,-0.040020093,-0.04627559,0.020173343,-0.009917095,-0.0016203993,0.011323953,-0.0009436628,0.00488318,0.023012182,0.015488002,0.10893103,-0.01006783,-0.010752417,0.017120963,0.04527069,-0.0035799518,0.018226352,-0.029820371,0.005241175,-0.037507847,0.003702424,-0.03569903,-0.00019450286,-0.012749653,0.017573167,-0.053159148,0.018728802,-0.059037805,-0.00437445,0.003002135,0.009326717,-0.048159774,0.008416028,0.021931916,-0.0034229364,-0.02267303,0.00284826,0.0025970354,0.059590496,-0.007398567,-0.050998613,-0.031805046,-0.05848511,0.07853284,0.026403716,-0.051300082,-0.005762466,0.0024541512,-0.006123602,0.014797134,-0.026102247,0.004456098,0.06536867,-0.006277477,-0.025599796,-0.029820371,0.017937444,-0.044416524,-0.0026017458,0.038161032,-0.041904278,0.012605199,-0.055369925,0.023439264,0.034392662,0.0140057765,-0.