	 ('(a) Standard. For a breach of unsecured protected health information involving more than 500 residents of a State or jurisdiction, a covered entity shall, following the discovery of the breach as provided in § 164.404(a)(2), notify prominent media outlets serving the State or jurisdiction. (b) Implementation specification: Timeliness of notification. Except as provided in § 164.412, a covered entity shall provide the notification required by paragraph (a) of this section without unreasonable delay and in no case later than 60 calendar days after discovery of a breach. (c) Implementation specifications: Content of notification. The notification required by paragraph (a) of this section shall meet the requirements of § 164.404(c). [74 FR 42740, Aug. 24, 2009, as amended at 78 FR 5695, Jan. 25, 2013]',164,'SECURITY AND PRIVACY','D','Notification in the Case of Breach of Unsecured Protected Health Information','164.406','Notification to the media','{164.404,164.412}','[0.008405313,0.012692264,0.03680034,0.059246622,-0.012108227,0.025673537,0.009206106,-0.060209982,0.0026582705,0.03046625,0.023662522,-0.021735802,0.00096034916,0.0074600168,0.034006596,0.023746816,0.04409779,-0.0013306405,-0.011933618,-0.0075382898,0.0065990137,0.029767815,0.017292306,0.040461108,-0.011313455,-0.026420139,-0.023096548,0.02673323,0.023481892,0.023253094,0.058764942,-0.00132763,0.0389679,0.024348916,0.033356328,0.012523676,-0.008098243,0.023734774,0.0039106384,0.053562798,-0.03704118,-0.015522133,-0.02092899,0.0023677575,-0.054574326,-0.0056446856,0.0072071347,-0.0070505887,-0.020796528,0.051973253,0.033693504,0.009218148,0.0009987331,-0.01743681,0.01725618,-0.013306405,0.00081433996,0.026709147,0.024324832,0.021314332,0.01966458,-0.0065147197,-0.029117547,-0.050142873,0.023782942,-0.04910726,0.016401198,0.05231043,0.054092646,0.009519198,0.0075864573,0.045518745,-0.0002709449,-0.048938673,-0.02521594,0.05587486,-0.00046098267,0.0038444072,0.0143781435,0.0030150148,-0.010452453,-0.02892