	 ('(a)(1) Standard: Health care component. If a covered entity is a hybrid entity, the requirements of this part, other than the requirements of this section, § 164.314, and § 164.504, apply only to the health care component(s) of the entity, as specified in this section. (2) Implementation specifications: (i) Application of other provisions. In applying a provision of this part, other than the requirements of this section, § 164.314, and § 164.504, to a hybrid entity: (A) A reference in such provision to a “covered entity” refers to a health care component of the covered entity; (B) A reference in such provision to a “health plan,” “covered health care provider,” or “health care clearinghouse,” refers to a health care component of the covered entity if such health care component performs the functions of a health plan, health care provider, or health care clearinghouse, as applicable; (C) A reference in such provision to “protected health information” refers to protected health information that is created or received by or on behalf of the health care component of the covered entity; and (D) A reference in such provision to “electronic protected health information” refers to electronic protected health information that is created, received, maintained, or transmitted by or on behalf of the health care component of the covered entity. (ii) Safeguard requirements. The covered entity that is a hybrid entity must ensure that a health care component of the entity complies with the applicable requirements of this part. In particular, and without limiting this requirement, such covered entity must ensure that: (A) Its health care component does not disclose protected health information to another component of the covered entity in circumstances in which subpart E of this part would prohibit such disclosure if the health care component and the other component were separate and distinct legal entities; (B) Its health care component protects electronic protected health information with respect to another component of the covered entity to the same extent that it would be required under subpart C of this part to protect such information if the health care component and the other component were separate and distinct legal entities; (C) If a person performs duties for both the health care component in the capacity of a member of the workforce of such component and for another component of the entity in the same capacity with respect to that component, such workforce member must not use or disclose protected health information created or received in the course of or incident to the member''s w ork for the health care component in a way prohibited by subpart E of this part. (iii) Responsibilities of the covered entity. A covered entity that is a hybrid entity has the following responsibilities: (A) For purposes of subpart C of part 160 of this subchapter, pertaining to compliance and enforcement, the covered entity has the responsibility of complying with this part. (B) The covered entity is responsible for complying with § 164.316(a) and § 164.530(i), pertaining to the implementation of policies and procedures to ensure compliance with applicable requirements of this part, including the safeguard requirements in paragraph (a)(2)(ii) of this section. (C) The covered entity is responsible for complying with',164,'SECURITY AND PRIVACY','A','General Provisions','164.105','Organizational requirements','{164.314,164.316,164.504,164.530}','[0.00844177,0.030456154,0.06069304,0.06183323,0.0310701,0.033350475,0.009806706,0.009198241,0.014033073,0.03234185,0.025281457,-0.06095616,0.027145226,0.0056104884,-0.016291521,-0.006079171,0.046747673,-0.015414454,0.023834297,-0.0038645768,0.037450764,0.025829624,0.040542424,0.034819562,-0.028702019,-0.042537753,-0.011763662,0.0019775121,-0.0020939976,0.017344002,0.06367507,-0.022781817,0.018889831,-0.0066383015,0.040432792,-0.002965583,-0.028789727,0.026838252,0.002511975,0.06981454,-0.016072255,-0.02151007,