	 ('As used in this subpart, the following terms have the following meanings: Access means the ability or the means necessary to read, write, modify, or communicate data/information or otherwise use any system resource. (This definition applies to “access” as used in this subpart, not as used in subparts D or E of this part.) Administrative safeguards are administrative actions, and policies and procedures, to manage the selection, development, implementation, and maintenance of security measures to protect electronic protected health information and to manage the conduct of the covered entity''s or business associate''s workforce in relation to the protection of that information. Authentication means the corroboration that a person is the one claimed. Availability means the property that data or information is accessible and useable upon demand by an authorized person. Confidentiality means the property that data or information is not made available or disclosed to unauthorized persons or processes. Encryption means the use of an algorithmic process to transform data into a form in which there is a low probability of assigning meaning without use of a confidential process or key. Facility means the physical premises and the interior and exterior of a building(s). Information system means an interconnected set of information resources under the same direct management control that shares common functionality. A system normally includes hardware, software, information, data, applications, communications, and people. Integrity means the property that data or information have not been altered or destroyed in an unauthorized manner. Malicious software means software, for example, a virus, designed to damage or disrupt a system. Password means confidential authentication information composed of a string of characters. Physical safeguards are physical measures, policies, and procedures to protect a covered entity''s or business associate''s electronic information systems and related buildings and equipment, from natural and environmental hazards, and unauthorized intrusion. Security or Security measures encompass all of the administrative, physical, and technical safeguards in an information system. Security incident means the attempted or successful unauthorized access, use, disclosure, modification, or destruction of information or interference with system operations in an information system. Technical safeguards means the technology and the policy and procedures for its use that protect electronic protected health information and control access to it. User means a person or entity with authorized access. Workstation means an electronic computing device, for example, a laptop or desktop computer, or any other device that performs similar functions, and electronic media stored in its immediate environment. [68 FR 8376, Feb. 20, 2003, as amended at 74 FR 42767, Aug. 24, 2009; 78 FR 5693, Jan. 25, 2013]',164,'SECURITY AND PRIVACY','C','Security Standards for the Protection of Electronic Protected Health Information','164.304','Definitions','{}','[-0.0049827043,0.030230796,0.04347021,0.041988544,0.015282683,0.027482541,-0.022643225,-0.014255075,0.021185456,-0.0112499185,0.026980687,-0.0067869932,-0.009941511,-0.011357459,-0.0021000246,0.003142569,0.02157977,-0.013968301,-0.02270297,-0.017636623,0.035177656,0.047102686,-0.033958863,0.044784594,-0.04829758,-0.03410225,0.0027198754,0.014159484,0.0335526,-0.016943585,0.005012577,-0.027554236,0.0002735185,0.013358905,0.07441794,0.0062134443,-0.05224073,0.011913084,0.006102917,-0.007557699,-0.029035904,-0.012158038,-0.04067416,-0.011954905,-0.053244438,-0.002052229,-0.019500656,-0.05353121,-0.0058161425,-0.029657248,-0.021436382,0.0043016155,0.011590463,0.0103418,0.006530091,0.027219666,-0.022153318,0.021077914,-0.020253439,-0.024292177,0.022631276,0.005774321,-0.03957486,-0.022738816,-0.013514241,-0.0029722967,0.011978804,0.04750895,-0.038666744,-0.03680271,0.05276648,0.041630078,-0.0171108