	 ('A covered entity or business associate must, in accordance with § 164.306: (a)(1) Standard: Facility access controls. Implement policies and procedures to limit physical access to its electronic information systems and the facility or facilities in which they are housed, while ensuring that properly authorized access is allowed. (2) Implementation specifications: (i) Contingency operations (Addressable). Establish (and implement as needed) procedures that allow facility access in support of restoration of lost data under the disaster recovery plan and emergency mode operations plan in the event of an emergency. (ii) Facility security plan (Addressable). Implement policies and procedures to safeguard the facility and the equipment therein from unauthorized physical access, tampering, and theft. (iii) Access control and validation procedures (Addressable). Implement procedures to control and validate a person''s access to facilities based on their role or function, including visitor control, and control of access to software programs for testing and revision. (iv) Maintenance records (Addressable). Implement policies and procedures to document repairs and modifications to the physical components of a facility which are related to security (for example, hardware, walls, doors, and locks). (b) Standard: Workstation use. Implement policies and procedures that specify the proper functions to be performed, the manner in which those functions are to be performed, and the physical attributes of the surroundings of a specific workstation or class of workstation that can access electronic protected health information. (c) Standard: Workstation security. Implement physical safeguards for all workstations that access electronic protected health information, to restrict access to authorized users. (d)(1) Standard: Device and media controls. Implement policies and procedures that govern the receipt and removal of hardware and electronic media that contain electronic protected health information into and out of a facility, and the movement of these items within the facility. (2) Implementation specifications: (i) Disposal (Required). Implement policies and procedures to address the final disposition of electronic protected health information, and/or the hardware or electronic media on which it is stored. (ii) Media re-use (Required). Implement procedures for removal of electronic protected health information from electronic media before the media are made available for re- use. (iii) Accountability (Addressable). Maintain a record of the movements of hardware and electronic media and any person responsible therefore. (iv) Data backup and storage (Addressable). Create a retrievable, exact copy of electronic protected health information, when needed, before movement of equipment. [68 FR 8376, Feb. 20, 2003, as amended at 78 FR 5694, Jan. 25, 2013]',164,'SECURITY AND PRIVACY','C','Security Standards for the Protection of Electronic Protected Health Information','164.310','Physical safeguards','{164.306}','[-0.0059006494,0.033796325,0.055828743,0.021309631,0.016549233,0.028338071,-0.016088149,0.009738876,0.0074770637,-0.015726756,0.044588223,-0.012748393,0.011732759,-0.01314717,-0.025135396,-0.0126923155,0.03446926,0.001834996,0.013458714,0.013770259,0.026144799,0.043765746,-0.02152148,-0.0015514906,-0.03479327,-0.049523085,0.023914142,0.015215824,0.021895334,-0.03339755,0.042694032,-0.010710893,-0.02530986,0.0021963874,0.02861223,-0.012673623,-0.061860237,-0.019664677,0.009732644,0.032450456,0.0001549933,-0.031129507,-0.024661848,-0.028338071,-0.0077449917,0.01293532,-0.009290252,-0.03486804,-0.011807529,0.011053592,0.013097323,0.029310089,0.021147627,-0.026967276,0.025920486,0.011626834,0.0033709095,0.014318577,-0.0049722474,0.01694801,0.021459172,-0.020624233,-0.052140057,0.003395833,-0.01863035,0.005187213,0.011228057,0.030406725,0.014231345,-0.008249694,0.016835855,0.056975223,-0.023428133,-0.012062996,0.015689371,0.0075019873,-0.0116766