	 ('A covered entity or business associate must, in accordance with § 164.306: (a)(1) Standard: Access control. Implement technical policies and procedures for electronic information systems that maintain electronic protected health information to allow access only to those persons or software programs that have been granted access rights as specified in § 164.308(a)(4). (2) Implementation specifications: (i) Unique user identification (Required). Assign a unique name and/or number for identifying and tracking user identity. (ii) E mergency access procedure (Required). Establish (and implement as needed) procedures for obtaining necessary electronic protected health information during an emergency. (iii) Automatic logoff (Addressable). Implement electronic procedures that terminate an electronic session after a predetermined time of inactivity. (iv) Encryption and decryption (Addressable). Implement a mechanism to encrypt and decrypt electronic protected health information. (b) Standard: Audit controls. Implement hardware, software, and/or procedural mechanisms that record and examine activity in information systems that contain or use electronic protected health information. (c)(1) Standard: Integrity. Implement policies and procedures to protect electronic protected health information from improper alteration or destruction. (2) Implementation specification: Mechanism to authenticate electronic protected health information (Addressable). Implement electronic mechanisms to corroborate that electronic protected health information has not been altered or destroyed in an unauthorized manner. (d) Standard: Person or entity authentication. Implement procedures to verify that a person or entity seeking access to electronic protected health information is the one claimed. (e)(1) Standard: Transmission security. Implement technical security measures to guard against unauthorized access to electronic protected health information that is being transmitted over an electronic communications network. (2) Implementation specifications: (i) Integrity controls (Addressable). Implement security measures to ensure that electronically transmitted electronic protected health information is not improperly modified without detection until disposed of. (ii) Encryption (Addressable). Implement a mechanism to encrypt electronic protected health information whenever deemed appropriate. [68 FR 8376, Feb. 20, 2003, as amended at 78 FR 5694, Jan. 25, 2013]',164,'SECURITY AND PRIVACY','C','Security Standards for the Protection of Electronic Protected Health Information','164.312','Technical safeguards','{164.306,164.308}','[-0.0048166034,-0.0009823136,0.055088572,0.034667388,0.007822042,0.0378035,-5.4842043e-05,0.017309384,0.014610871,-0.008344728,0.0500319,-0.028176371,0.022378214,-0.0033852973,-0.0057677687,-0.015899349,0.027544286,0.0041085477,0.019728322,0.02203786,0.030704707,0.04283586,-0.0064545525,0.005673564,-0.038532827,-0.056936204,-0.003759078,0.022183726,0.022767188,-0.029610716,0.04901084,-0.0037408448,0.005235967,-0.004895614,0.034813255,-0.015182178,-0.06544503,-0.0009033031,0.031409726,0.03051022,0.012033911,-0.033038557,-0.017977934,-0.01879235,-0.014574404,0.004482328,0.0037864277,-0.07016135,-0.011657092,0.0066551175,-0.0021317648,0.051587798,0.010362535,0.0027623298,0.012629529,0.003667912,0.01016197,0.012277021,-0.022463301,0.016422035,0.00943872,-0.025745276,-0.06724404,-0.006551796,0.0022107754,0.009450875,0.0015369067,0.030145556,0.02893001,-0.008235328,0.019655388,0.061603904,0.0004949554,-0.008448049,0.010423312,-0.0022107754,-0.01552253,0.01876804,0.011450449,-0.00081973424,-0.0056826803,-0.00039201378,-0.020020053,0.011079707,-0.05523444,0.05324094,-0.079399504,0.011511226,-0.039164912,-0.013127903,-0.02141793,0.08153886,-0.03967544,0.0045157555,0.015157866,-0.022852276,-0.015619774,0.014987689,-0.014683804,0.023253407,0.005375755,-0.058248993,-0.034083925,-0.07735739,0.07429421,0.01075151,-0.012532285,-0.009207766,-0.00676451