	 ('(a)(1) Standard: Business associate contracts or other arrangements. The contract or other arrangement required by § 164.308(b)(3) must meet the requirements of paragraph (a)(2)(i), (a)(2)(ii), or (a)(2)(iii) of this section, as applicable. (2) Implementation specifications (Required). (i) Business associate contracts. The contract must provide that the business associate will— (A) Comply with the applicable requirements of this subpart; (B) In accordance with § 164.308(b)(2), ensure that any subcontractors that create, receive, maintain, or transmit electronic protected health information on behalf of the business associate agree to comply with the applicable requirements of this subpart by entering into a contract or other arrangement that complies with this section; and (C) Report to the covered entity any security incident of which it becomes aware, including breaches of unsecured protected health information as required by § 164.410. (ii) Other arrangements. The covered entity is in compliance with paragraph (a)(1) of this section if it has another arrangement in place that meets the requirements of § 164.504(e)(3). (iii) Business associate contracts with subcontractors. The requirements of paragraphs (a)(2)(i) and (a)(2)(ii) of this section apply to the contract or other arrangement between a business associate and a subcontractor required by § 164.308(b)(4) in the same manner as such requirements apply to contracts or other arrangements between a covered entity and business associate. (b)(1) Standard: Requirements for group health plans. Except when the only electronic protected health information disclosed to a plan sponsor is disclosed pursuant to § 164.504(f)(1)(ii) or (iii), or as authorized under § 164.508, a group health plan must ensure that its plan documents provide that the plan sponsor will reasonably and appropriately safeguard electronic protected health information created, received, maintained, or transmitted to or by the plan sponsor on behalf of the group health plan. (2) Implementation specifications (Required). The plan documents of the group health plan must be amended to incorporate provisions to require the plan sponsor to— (i) Implement administrative, physical, and technical safeguards that reasonably and appropriately protect the confidentiality, integrity, and availability of the electronic protected health information that it creates, receives, maintains, or transmits on behalf of the group health plan; (ii) Ensure that the adequate separation required by § 164.504(f)(2)(iii) is supported by reasonable and appropriate security measures; (iii) Ensure that any agent to whom it provides this information agrees to implement reasonable and appropriate security measures to protect the information; and (iv) Report to the group health plan any security incident of which it becomes aware. [68 FR 8376, Feb. 20, 2003, as amended at 78 FR 5694, Jan. 25, 2013]',164,'SECURITY AND PRIVACY','C','Security Standards for the Protection of Electronic Protected Health Information','164.314','Organizational requirements','{164.308,164.410,164.504,164.508}','[-0.013219502,0.014470918,0.07290066,0.031376407,0.00089305587,0.021387834,0.00986912,-0.022616496,0.017519822,-0.0019425387,0.024846293,-0.03287811,0.042821176,0.019476581,-0.012980595,0.0130147245,0.01599537,-0.005938537,-0.000897322,-0.014743954,0.042957693,0.06370844,0.018702978,0.0070648114,-0.03101236,-0.046438903,-0.0059214723,-0.004195087,0.03547195,-0.023458358,0.06420901,-0.0026578365,-0.0065358034,-0.012787195,0.015790593,0.006274144,-0.030284263,0.0051734666,0.0133218905,0.02941965,0.012536911,-0.011234301,0.01410687,-0.010346933,0.00811145,0.025756413,-0.003765624,-0.057383105,-0.006586998,0.024687022,0.007798596,0.011740556,0.021786012,-0.011933956,0.016495936,0.022388967,0.009652967,0.0077701546,-0.018782614,0.01765634,0.013731445,-0.026234226,-0.046074856,0.013606303,-0.021262692,-0.0036916768,0.005426594,0.00860064,0.014709825,0.021456093,0.