	 ('As used in this subpart, the following terms have the following meanings: Breach means the acquisition, access use, or disclosure of protected health information in a manner not permitted under subpart E of this part which compromises the security or privacy of the protected health information. (1) Breach excludes: (i) Any unintentional acquisition, access, or use of protected health information by a workforce member or person acting under the authority of a covered entity or a business associate, if such acquisition, access, or use was made in good faith and within the scope of authority and does not result in further use or disclosure in a manner not permitted under subpart E of this part. (ii) Any inadvertent disclosure by a person who is authorized to access protected health information at a covered entity or business associate to another person authorized to access protected health information at the same covered entity or business associate, or organized health care arrangement in which the covered entity participates, and the information received as a result of such disclosure is not further used or , disclosed in a manner not permitted under subpart E of this part. (iii) A disclosure of protected health information where a covered entity or business associate has a good faith belief that an unauthorized person to whom the disclosure was made would not reasonably have been able to retain such information. (2) Except as provided in paragraph (1) of this definition, an acquisition, access, use, or disclosure of protected health information in a manner not permitted under subpart E is presumed to be a breach unless the covered entity or business associate, as applicable, demonstrates that there is a low probability that the protected health information has been compromised based on a risk assessment of at least the following factors: (i) The nature and extent of the protected health information involved, including the types of identifiers and the likelihood of re- identification; (ii) The unauthorized person who used the protected health information or to whom the disclosure was made; (iii) Whether the protected health information was actually acquired or viewed; and (iv) The extent to which the risk to the protected health information has been mitigated. Unsecured protected health information means protected health information that is not rendered unusable, unreadable, or indecipherable to unauthorized persons through the use of a technology or methodology specified by the Secretary in the guidance issued under section 13402(h)(2) of Public Law 111-5. [78 FR 5695, Jan. 25, 2013]',164,'SECURITY AND PRIVACY','D','Notification in the Case of Breach of Unsecured Protected Health Information','164.402','Definitions','{}','[0.0103622135,0.019032879,0.04487927,0.07031164,0.046346065,0.0025979464,-0.013343125,-0.02200196,0.0044033495,-0.008351281,0.03839697,-0.0028389627,-0.0054827468,0.01184084,0.019577013,-0.008954561,0.031133957,-0.028247679,-0.028129388,0.012822648,0.03446974,0.072156966,-0.0065946737,0.016820854,-0.053277865,-0.026284061,-0.008889502,-0.02272353,0.023717167,0.027892807,0.058624577,-0.012337659,0.019565184,0.0058050873,0.05129059,-0.00020589872,-0.030968351,0.0005367414,0.012467777,0.026828196,-0.007079663,-0.03669359,-0.013425928,-0.004855809,-0.019092023,0.008570119,-0.011627918,-0.05285202,-0.016584273,0.0062575466,-0.029028393,0.012148394,-0.008197504,0.017152065,-0.0019414364,0.026094798,0.001137803,0.0098358225,-0.051716436,-0.014218471,0.032577097,0.0005419166,-0.008723896,-0.0044506653,0.015389543,-0.033192206,0.02486458,0.030708112,0.007830805,-0.026638933,0.039769135,0.057536308,-0.01911568,-0.0046192287,0.022380488,0.038775496,0.022451462,-0.0012753152,-0.008712066,0.010705255,-0.0096761305,0.0010135984,-0.042087622,0.010385872,-0.048356995,0.030660797,-0.10930006,0.01219571,-0.004163812,-0.054697346,-0.02618943,0.02369351,0.016158428,0.006778023,-0.027798176,-0.025266767,-0.04719775,-0.0076592