	 ('(a) Standard. A covered entity shall, following the discovery of a breach of unsecured protected health information as provided in § 164.404(a)(2), notify the Secretary. (b ) Implementation specifications: Breaches involving 500 or more individuals. For breaches of unsecured protected health information involving 500 or more individuals, a covered entity shall, except as provided in § 164.412, provide the notification required by paragraph (a) of this section contemporaneously with the notice required by § 164.404(a) and in the manner specified on the HHS Web site. (c) Implementation specifications: Breaches involving less than 500 individuals. For breaches of unsecured protected health information involving less than 500 individuals, a covered entity shall maintain a log or other documentation of such breaches and, not later than 60 days after the end of each calendar year, provide the notification required by paragraph (a) of this section for breaches discovered during the preceding calendar year, in the manner specified on the HHS web site. [74 FR 42740, Aug. 24, 2009, as amended at 78 FR 5695, Jan. 25, 2013]',164,'SECURITY AND PRIVACY','D','Notification in the Case of Breach of Unsecured Protected Health Information','164.408','Notification to the Secretary','{164.404,164.412}','[-0.0020423778,-0.009531097,0.057971224,0.041470658,-0.011186923,0.03080875,0.007211786,-0.040362924,-0.0008805591,0.012692744,0.011561936,-0.040709093,0.0040501393,0.007598338,0.035493527,0.017250594,0.04123988,-0.005688657,-0.006963701,-0.013004293,0.02718555,0.035447374,0.0206084,0.0535403,-0.0009923418,-0.02748556,-0.014585117,0.0037876302,0.017827535,0.028408669,0.06258677,0.0014704833,0.030485664,0.03583969,0.022166146,0.006963701,-0.0025284523,0.034847353,0.0019630482,0.071633235,-0.01445819,-0.015900547,-0.016246712,0.0058963564,-0.04375535,-0.0077771903,0.013235071,-0.04453999,-0.04084756,0.022512313,0.018808339,0.016154401,-0.007004087,-0.014515883,0.024300836,0.017204437,0