	 ('If a law enforcement official states to a covered entity or business associate that a notification, notice, or posting required under this subpart would impede a criminal investigation or cause damage to national security, a covered entity or business associate shall: (a) If the statement is in writing and specifies the time for which a delay is required, delay such notification, notice, or posting for the time period specified by the official; or (b) If the statement is made orally, document the statement, including the identity of the official making the statement, and delay the notification, notice, or posting temporarily and no longer than 30 days from the date of the oral statement, unless a written statement as described in paragraph (a) of this section is submitted during that time.',164,'SECURITY AND PRIVACY','D','Notification in the Case of Breach of Unsecured Protected Health Information','164.412','Law enforcement delay','{}','[0.0080829915,0.04271753,0.02950172,0.03945555,-0.046147406,0.035450034,0.0024824617,-0.06418423,0.019140141,0.016933508,-0.0013881399,-0.025112439,0.006005279,0.004023507,0.0097079845,0.029022017,0.017772987,0.005063862,0.0021826476,0.008538709,0.02633568,0.03753674,-0.03343528,0.060202695,-0.005225762,-0.022318171,-0.0012577206,-0.012748101,0.049841117,0.03113271,0.057564333,-0.0022635974,-0.015254548,0.010547465,-0.0021961392,0.047394633,-0.0055945334,-0.004446245,0.007825151,0.014582964,-0.0064939763,-0.04504409,-0.021910423,-0.06437611,-0.01166877,0.054925967,-0.0380884,-0.01825269,-0.002047731,0.019200103,0.020375375,0.003624754,-0.018972244,0.004988909,0.0033879008,0.0024479833,0.014954734,0.034946345,0.008916475,0.040774737,0.01155484,-0.026575534,-0.03365115,-0.010481506,0.0010163703,-0.030796917,-0.00015627817,0.04588357,0.0032559824,0.0016564736,-0.0035108246,0.06581522,0.03907179,-0.017437195,0.00227559,0.06509566,-0.0046501188,0.011938603,-0.0056964704,-0.00164598,-0.047466587,-0.009354204,-0.018288668,0.062841065,-