	 ('(a) Except as otherwise provided herein, the standards, requirements, and implementation specifications of this subpart apply to covered entities with respect to protected health information. (b) Health care clearinghouses must comply with the standards, requirements, and implementation specifications as follows: (1) When a health care clearinghouse creates or receives protected health information as a business associate of another covered entity, the clearinghouse must comply with: (i) Section 164.500 relating to applicability; (ii) Section 164.501 relating to definitions; (iii) Section 164.502 relating to uses and disclosures of protected health information, except that a clearinghouse is prohibited from using or disclosing protected health information other than as permitted in the business associate contract under which it created or received the protected health information; (iv) Section 164.504 relating to the organizational requirements for covered entities; (v) Section 164.512 relating to uses and disclosures for which individual authorization or an opportunity to agree or object is not required, except that a clearinghouse is prohibited from using or disclosing protected health information other than as permitted in the business associate contract under which it created or received the protected health information; (vi) Section 164.532 relating to transition requirements; and (vii) Section 164.534 relating to compliance dates for initial implementation of the privacy standards. (2 ) When a health care clearinghouse creates or receives protected health information other than as a business associate of a covered entity, the clearinghouse must comply with all of the standards, requirements, and implementation specifications of this subpart. (c) Where provided, the standards, requirements, and implementation specifications adopted under this subpart apply to a business associate with respect to the protected health information of a covered entity. (d) The s