	 ('(a) Standard: Permitted uses and disclosures. Except with respect to uses or disclosures that require an authorization under § 164.508(a)(2) through (4) or that are prohibited under § 164.502(a)(5)(i), a covered entity may use or disclose protected health information for treatment, payment, or health care operations as set forth in paragraph (c) of this section, provided that such use or disclosure is consistent with other applicable requirements of this subpart. (b) Standard: Consent for uses and disclosures permitted. (1) A covered entity may obtain consent of the individual to use or disclose protected health information to carry out treatment, payment, or health care operations. (2) Consent, under paragraph (b) of this section, shall not be effective to permit a use or disclosure of protected health information when an authorization, under § 164.508, is required or when another condition must be met for such use or disclosure to be permissible under this subpart. (c) Implementation specifications: Treatment, payment, or health care operations. (1) A covered entity may use or disclose protected health information for its own treatment, payment, or health care operations. (2) A covered entity may disclose protected health information for treatment activities of a health care provider. (3) A covered entity may disclose protected health information to another covered entity or a health care provider for the payment activities of the entity that receives the information. (4) A covered entity may disclose protected health information to another covered entity for health care operations activities of the entity that receives the information, if each entity either has or had a relationship with the individual who is the subject of the protected health information being requested, the protected health information pertains to such relationship, and the disclosure is: (i) For a purpose listed in paragraph (1) or (2) of the definition of health care operations; or (ii) For the purpose of health care fraud and abuse detection or compliance. (5) A covered entity that participates in an organized health care arrangement may disclose protected health information about an individual to other participants in the organized health care arrangement for any health care operations activities of the organized health care arrangement. [ 67 FR 53268, Aug. 14, 2002, as amended at 78 FR 5698, Jan. 25, 2013]',164,'SECURITY AND PRIVACY','E','Privacy of Individually Identifiable Health Information','164.506','Uses and disclosures to carry out treatment, payment, or health care operations','{164.502,164.508}','[0.00862175,0.0023941684,0.04535337,0.04504604,0.023510871,0.013467712,-0.023708442,-0.011920078,-0.0011730739,0.0036413313,0.018560637,-0.039953116,0.0114590805,0.029920932,0.023532823,-0.035672422,0.067832485,-0.005128597,-0.0014474771,0.0006273544,0.03134783,0.038131077,-0.020953434,-0.0027220803,-0.023466967,-0.051412195,-0.007211318,0.00845162,0.01704593,-0.0026136911,0.01247986,-0.0072497344,0.01824233,-0.0148068,0.010795024,-0.022336425,-0.038482312,0.019866796,0.029459935,0.03571633,-0.02189738,-0.058393013,-0.03534314,-0.0029361148,-0.007579018,0.00012708301,-0.041797105,-0.062124897,-0.014949489,0.013116476,0.0009384591,0.036748085,-0.005109389,-0.0024161206,0.021919332,0.05659293,-0.0040474483,0.015849533,0.0036852357,-0.008171729,0.018867968,-0.0030431321,-0.05163172,-0.020360721,-0.006245418,0.035562664,-0.0009556094,0.036462706,0.019778987,0.015125108,0.022369353,0.05106096,-0.02564024,0.0027207083,0.01412628,0.03295034,0.005334399,0.010816976,-0.008232098,0.008100384,0.0086052865,-0.0045907665,-0.037845697,0.018560637,-0.008868713,0.061202902,-0.06721782,0.04280691,-0.017430095,-0.013467712,-0.027747657,0.033696722,-0.02873551,-0.004862426,0.0157727,-0.022369353,-0.04105073,0.013610402,-0.007924766,0.030952688,-0.0046621114,-0.04434357,-0.029394077,-0.053651325,0.062124897,-0.012567669,-0.052948855,0.011393223,0.010059624,0.01434