INSERT INTO public.document_chunks (chunk_text,part_number,part_name,subpart_letter,subpart_name,article_number,article_title,referenced_articles,chunk_embedding,metadata,created_at) VALUES
	 ('(a)(1) Standard: Right of an individual to request restriction of uses and disclosures. (i) A covered entity must permit an individual to request that the covered entity restrict: (A) Uses or disclosures of protected health information about the individual to carry out treatment, payment, or health care operations; and (B) Disclosures permitted under § 164.510(b). (ii) Except as provided in paragraph (a)(1)(vi) of this section, a covered entity is not required to agree to a restriction. (iii) A covered entity that agrees to a restriction under paragraph (a)(1)(i) of this section may not use or disclose protected health information in violation of such restriction, except that, if the individual who requested the restriction is in need of emergency treatment and the restricted protected health information is needed to provide the emergency treatment, the covered entity may use the restricted protected health information, or may disclose such information to a health care provider, to provide such treatment to the individual. (iv) If restricted protected health information is disclosed to a health care provider for emergency treatment under paragraph (a)(1)(iii) of this section, the covered entity must request that such health care provider not further use or disclose the information. (v) A restriction agreed to by a covered entity under paragraph (a) of this section, is not effective under this subpart to prevent uses or disclosures permitted or required under §§ 164.502(a)(2)(ii), 164.510(a) or 164.512. (vi) A covered entity must agree to the request of an individual to restrict dis closure of protected health information about the individual to a health plan if: (A) The disclosure is for the purpose of carrying out payment or health care operations and is not otherwise required by law; and (B) The protected health information pertains solely to a health care item or service for which the individual, or person other than the health plan on behalf of the individual, has paid the covered entity in full. (2) Implementation specifications: Terminating a restriction. A covered entity may terminate a restriction, if: (i) The individual agrees to or requests the termination in writing; (ii) The individual orally agrees to the termination and the oral agreement is documented; or (iii) The covered entity informs the individual that it is terminating its agreement to a restriction, except that such termination is: (A) Not effective for protected health information restricted under paragraph (a)(1)(vi) of this section; and (B) Only effective with respect to protected health information created or received after it has so informed the individual. (3) Implementation specification: Documentation. A covered entity must document a restriction in accordance with § 160.530(j) of this subchapter. (b)(1) Standard: Confidential communications requirements. (i) A covered health care provider must permit individuals to request and must accommodate reasonable requests by individuals to receive communications of protected health information from the covered health care provider by alternative means or at alternative locations. (ii) A health plan must permit individuals to request and must accommodate reasonable requests by individuals to receive communications of protected health information from the health plan by alternative means or at alternative locations, if the individual clearly states that the disclosure of all or part of that information could endanger the individual. (2) Implementation specifications: Conditions on providing confidential communications. (i) A covered entity may require the individual to make a request for a confidential communication described in paragraph (b)(1) of this section in writing. (ii) A covered entity may condition the provision of a reasonable accommodation on: (A) When appropriate, information as to how payment, if any, will be handled; and (B) Specification of an alternative address or other method of contact. (iii) A covered health care provider may not require an explanation from the individual as to the basis for the request as a condition of providing communications on a confidential basis. (iv) A health plan may require that a request contain a statement that disclosure of all or part of the information to which the request pertains could endanger the individual. [65 FR 82802, Dec. 28, 2000, as amended at 67 FR 53271, Aug. 14, 2002; 78 FR 5701, Jan. 25, 2013]',164,'SECURITY AND PRIVACY','E','Privacy of Individually Identifiable Health Information','164.522','Rights to request privacy protection for protected health information','{160.530,164.502,164.510}','[0.04587194,0.029470535,0.05241832,0.027154487,-0.0015287693,0.025169302,-0.020986235,-0.009305552,0.006510932,0.02279417,0.018150257,-0.04393402,0.009400085,0.056105092,0.010156346,-0.010244969,0.061824314,0.009772306,0.025169302,0.046888165,0.047337197,0.023751313,-0.024141261,0.025571065,-0.032684643,-0.02658729,0.025027504,0.00329387,0.009990913,-0.018741086,0.052938253,-0.00876199,0.014179889,0.004747309,0.034646194,0.013021864,-0.035567887,0.0017045408,0.03887653,0.051709328,-0.010540384,-0.03266101,-0.019721862,0.010883065,-0.04067265,0.030439494,-0.04149981,-0.03601692,-0.028501576,-0.021612514,-0.004274646,0.025311101,0.0036720003,0.013305462,-5.3682325e-05,0.017157665,-0.024164893,0.038758364,-0.0053145043,0.0030161806,0.025169302,-0.022049727,-0.04769169,-0.021387998,-0.018268423,-0.0015627419,0.020253608,0.053789046,0.025476534,0.007479891,0.02200246,0.03897106,-0.015987825,-0.007184477,-0.010605375,0.0029157395,0.015089765,0.017630327,-0.037789404,0.012171071,-0.019367365,0.0116688665,-0.03911286,0.0211753,-0.03228288,0.052938253,-0.06021726,0.04173614,-0.0168977,-0.020088175,-0.0014371908,0.019367365,-0.053505447,0.029305104,0.023633149,-0.026232794,-0.022203343,0.019910928,-0.003355907,0.049724143,-0.016212339,-0.068677925,-0.04766806,-0.05615236,0.09004229,-0.007332184,-0.033606336,0.019237382,-