	 ('(a) Standard: Right to an accounting of disclosures of protected health information. (1) An individual has a right to receive an accounting of disclosures of protected health information made by a covered entity in the six years prior to the date on which the accounting is requested, except for disclosures: (i) To carry out treatment, payment and health care operations as provided in § 164.506; (ii) To individuals of protected health information about them as provided in § 164.502; (iii) Incident to a use or disclosure otherwise permitted or required by this subpart, as provided in § 164.502; (iv)Pursuant to an authorization as provided in § 164.508; (v) For the facility''s directory or to persons involved in the individual''s care or other notification purposes as provided in § 164.510; (vi) For national security or intelligence purposes as provided in § 164.512(k)(2); (vii) To correctional institutions or law enforcement officials as provided in § 164.512(k)(5); (viii) As part of a limited data set in accordance with § 164.514(e); or (ix) That occurred prior to the compliance date for the covered entity. (2)(i) The covered entity must temporarily suspend an individual''s right to receive an accounting of disclosures to a health oversight agency or law enforcement official, as provided in § 164.512(d) or (f), respectively, for the time specified by such agency or official, if such agency or official provides the covered entity with a written statement that such an accounting to the individual would be reasonably likely to impede the agency''s activities and specifying the time for which such a suspension is required. (ii) If the agency or official statement in paragraph (a)(2)(i) of this section is made orally, the covered entity must: (A) Document the statement, including the identity of the agency or official making the statement; (B) Temporarily suspend the individual''s right to an accounting of disclosures subject to the statement; and (C) Limit the temporary suspension to no longer than 30 days from the date of the oral statement, unless a written statement pursuant to paragraph (a)(2)(i) of this section is submitted during that time. (3) An individual may request an accounting of disclosures for a period of time less than six years from the date of the request. (b) Implementation specifications: Content of the accounting. The covered entity must provide the individual with a written accounting that meets the following requirements. (1) Except as otherwise provided by paragraph (a) of this section, the accounting must include disclosures of protected health information that occurred during the six years (or such shorter time period at the request of the individual as provided in paragraph (a)(3) of this section) prior to the date of the request for an accounting, including disclosures to or by business associates of the covered entity. (2) Except as otherwise provided by paragraphs (b)(3) or (b)(4) of this section, the accounting must include for each disclosure: (i) The date of the disclosure; (ii) The name of the entity or person who received the protected health information and, if known, the address of such entity or person; (iii) A brief description of the protected health information disclosed; and (iv) A brief statement of the purpose of the disclosure that reasonably informs the individual of the basis for the disclosure or, in lieu of such statement, a copy of a written request for a disclosure under §§ 164.502(a)(2)(ii) or 164.512, if any. (3) If, during the period covered by the accounting, the covered entity has made multiple disclosures of protected health information to the same person or entity for a single purpose under §§ 164.502(a)(2)(ii) or 164.512, the accounting may, with respect to such multiple disclosures, provide: (i) The information required by paragraph (b)(2) of this section for the first disclosure during the accounting period; (ii) The frequency, periodicity, or number of the disclosures made during the accounting period; and (iii) The date of the last such disclosure during the accounting period. (4)(i) If, during the period covered by the accounting, the covered entity has made disclosures of protected health information for a particular research purpose in accordance with § 164.512(i) for 50 or more individuals, the accounting may, with respect to such disclosures for which the protected health information about the individual may have been included, provide: (A) The name of the protocol or other research activity; (B) A description, in plain language, of the research protocol or other research activity, including the purpose of the research and the criteria for selecting particular records; (C) A brief description of the type of protected health information that was disclosed; (D) The date or period of time during which such disclosures occurred, or may have occurred, including the date of the last such disclosure during the accounting period; (E) The name, address, and telephone number of the entity that sponsored the research and of the researcher to wh om the information was disclosed; nd F) A statement that the protected ealth information of the individual ay or may not have been disclosed or a particular protocol or other esearch activity. ii) If the covered entity provides an ccounting for research disclosures, n accordance with paragraph (b)(4) f this section, and if it is reasonably ikely that the protected health nformation of the individual was isclosed for such research protocol r activity, the covered entity shall, at he request of the individual, assist in ontacting the entity that sponsored he research and the researcher. c) Implementation specifications: rovision of the accounting. (1) The overed entity must act on the ndividual''s request for an ccounting, no later than 60 days fter receipt of such a request, as ollows. i) The covered entity must provide he individual with the accounting equested; or ii) If the covered entity is unable to rovide the accounting within the ime required by paragraph (c)(1) of his section, the covered entity may xtend the time to provide the ccounting by no more than 30 days, rovided that: A) The covered entity, within the ime limit set by paragraph (c)(1) of his section, provides the individual ith a written statement of the easons for the delay and the date by hich the covered entity will provide he accounting; and B) The covered entity may have nly one such extension of time for ction on a request for an accounting. a ( h m f r ( a i o l i d o t c t ( P c i a a f ( t r ( p t t e a p ( t t w r w t ( o a (2) The covered entity must provide the first accounting to an individual in any 12 month period without charge. The covered entity may impose a reasonable, cost-based fee for each subsequent request for an accounting by the same individual within the 12 month period, provided that the covered entity informs the individual in advance of the fee and provides the individual with an opportunity to withdraw or modify the request for a subsequent accounting in order to avoid or reduce the fee. (d) Implementation specification: Documentation. A covered entity must document the following and retain the documentation as required by § 164.530(j): (1) The information required to be included in an accounting under paragraph (b) of this section for disclosures of protected health information that are subject to an accounting under paragraph (a) of this section; (2) The written accounting that is provided to the individual under this section; and (3) The titles of the persons or offices responsible for receiving and processing requests for an accounting by individuals. [65 FR 82802, Dec. 28, 2000, as amended at 67 FR 53271, Aug. 14, 2002]',164,'SECURITY AND PRIVACY','E','Privacy of Individually Identifiable Health Information','164.528','Accounting of disclosures of protected health information','{164.502,164.506,164.508,164.510,164.512,164.514,164.530}','[0.0054484233,0